(window.webpackJsonp=window.webpackJsonp||[]).push([[76],{Lr33:function(e){e.exports=[{id:1,type:"  opc_compute_acl",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the ACL.</p>\n</li>',elementType:"li",listDepth:1},{name:"enabled",description:'<li><p><a name="enabled"></a><a href="#enabled"><code>enabled</code></a> - <strong>(Optional)</strong> Enables or disables the ACL. Set to true by default.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> A description of the ACL.</p>\n</li>',elementType:"li",listDepth:1},{name:"tags",description:'<li><p><a name="tags"></a><a href="#tags"><code>tags</code></a> - <strong>(Optional)</strong> List of tags that may be applied to the ACL.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>In addition to the above, the following values are exported:</p>",elementType:"p"},{name:"uri",description:"The Uniform Resource Identifier for the ACL\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opc/r/opc_compute_acl.html",docType:""},{id:2,type:"  opc_compute_image_list",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the Image List.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Required)</strong> A description of the Image List.</p>\n</li>',elementType:"li",listDepth:1},{name:"default",description:'<li><p><a name="default"></a><a href="#default"><code>default</code></a> - <strong>(Required)</strong> The image list entry to be used, by default, when launching instances using this image list. Defaults to <code>1</code>.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opc/r/opc_compute_image_list.html",docType:""},{id:3,type:"  opc_compute_image_list_entry",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the Image List.</p>\n</li>',elementType:"li",listDepth:1},{name:"machine_images",description:'<li><p><a name="machine_images"></a><a href="#machine_images"><code>machine_images</code></a> - <strong>(Required)</strong> An array of machine images.</p>\n</li>',elementType:"li",listDepth:1},{name:"version",description:'<li><p><a name="version"></a><a href="#version"><code>version</code></a> - <strong>(Required)</strong> The unique version of the image list entry, as an integer.</p>\n</li>',elementType:"li",listDepth:1},{name:"attributes",description:'<li><p><a name="attributes"></a><a href="#attributes"><code>attributes</code></a> - <strong>(Optional)</strong> JSON String of optional data that will be passed to an instance of this machine image when it is launched.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opc/r/opc_compute_image_list_entry.html",docType:""},{id:4,type:"  opc_compute_instance",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"shape",description:'<li><p><a name="shape"></a><a href="#shape"><code>shape</code></a> - <strong>(Required)</strong> The shape of the instance, e.g. <code>oc4</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"instance_attributes",description:'<li><p><a name="instance_attributes"></a><a href="#instance_attributes"><code>instance_attributes</code></a> - <strong>(Optional)</strong> A JSON string of custom attributes. See <a href="#attributes">Attributes</a> below for more information.</p>\n</li>',elementType:"li",listDepth:1},{name:"boot_order",description:'<li><p><a name="boot_order"></a><a href="#boot_order"><code>boot_order</code></a> - <strong>(Optional)</strong> The index number of the bootable storage volume, presented as a list, that should be used to boot the instance. The only valid value is <code>[1]</code>. If you set this attribute, you must also specify a bootable storage volume with index number 1 in the volume sub-parameter of storage_attachments. When you specify boot_order, you don\'t need to specify the imagelist attribute, because the instance is booted using the image on the specified bootable storage volume. If you specify both boot_order and imagelist, the imagelist attribute is ignored.</p>\n</li>',elementType:"li",listDepth:1},{name:"hostname",description:'<li><p><a name="hostname"></a><a href="#hostname"><code>hostname</code></a> - <strong>(Optional)</strong> The host name assigned to the instance. On an Oracle Linux instance, this host name is displayed in response to the hostname command. Only relative DNS is supported. The domain name is suffixed to the host name that you specify. The host name must not end with a period. If you don\'t specify a host name, then a name is generated automatically.</p>\n</li>',elementType:"li",listDepth:1},{name:"image_list",description:'<li><p><a name="image_list"></a><a href="#image_list"><code>image_list</code></a> - <strong>(Optional)</strong> The imageList of the instance, e.g. <code>/oracle/public/oel_6.4_2GB_v1</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"label",description:'<li><p><a name="label"></a><a href="#label"><code>label</code></a> - <strong>(Optional)</strong> The label to apply to the instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"desired_state",description:'<li><p><a name="desired_state"></a><a href="#desired_state"><code>desired_state</code></a> - <strong>(Optional)</strong> Set the desire state of the instance to <code>running</code> (default) or <code>shutdown</code>. You can use this request to shut down and restart individual instances which use a persistent bootable storage volume.</p>\n</li>',elementType:"li",listDepth:1},{name:"networking_info",description:'<li><p><a name="networking_info"></a><a href="#networking_info"><code>networking_info</code></a> - <strong>(Optional)</strong> Information pertaining to an individual network interface to be created and attached to the instance. If left unspecified, the instance will be created within the <code>shared_network</code>. See <a href="#networking-info">Networking Info</a> below for more information.</p>\n</li>',elementType:"li",listDepth:1},{name:"storage",description:'<li><p><a name="storage"></a><a href="#storage"><code>storage</code></a> - <strong>(Optional)</strong> Information pertaining to an individual storage attachment to be created during instance creation. Please see <a href="#storage-attachments">Storage Attachments</a> below for more information.</p>\n</li>',elementType:"li",listDepth:1},{name:"reverse_dns",description:'<li><p><a name="reverse_dns"></a><a href="#reverse_dns"><code>reverse_dns</code></a> - <strong>(Optional)</strong> If set to <code>true</code> (default), then reverse DNS records are created. If set to <code>false</code>, no reverse DNS records are created.</p>\n</li>',elementType:"li",listDepth:1},{name:"ssh_keys",description:'<li><p><a name="ssh_keys"></a><a href="#ssh_keys"><code>ssh_keys</code></a> - <strong>(Optional)</strong> A list of the names of the SSH Keys that can be used to log into the instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"tags",description:'<li><p><a name="tags"></a><a href="#tags"><code>tags</code></a> - <strong>(Optional)</strong> A list of strings that should be supplied to the instance as tags.</p>\n</li>',elementType:"li",listDepth:1},{name:"attributes",description:'<h2 id="attributes">\n<a class="anchor" href="#attributes" name="attributes">\xbb</a>\n  Attributes\n</h2>',elementType:"h2"},{name:"",description:"<p>During instance creation, there are several custom attributes that a user may wish to make available to the instance during instance creation.\nThese attributes can be specified via the <code>instance_attributes</code> field, and must be presented as a string in JSON format.\nThe easiest way to populate this field is with a HEREDOC:</p>",elementType:"p"},{name:"",description:'<div class="highlight"><pre class="highlight hcl"><code><span class="n">resource</span> <span class="s2">"opc_compute_instance"</span> <span class="s2">"foo"</span> <span class="p">{</span>\n  <span class="nb">name</span> <span class="o">=</span> <span class="s2">"test"</span>\n  <span class="n">label</span> <span class="o">=</span> <span class="s2">"test"</span>\n  <span class="n">shape</span> <span class="o">=</span> <span class="s2">"oc3"</span>\n  <span class="n">imageList</span> <span class="o">=</span> <span class="s2">"/oracle/public/oel_6.4_2GB_v1"</span>\n  <span class="n">instance_attributes</span> <span class="o">=</span> <span class="o">&lt;&lt;</span><span class="no">JSON</span><span class="sh">\n{\n  "foo": "bar",\n  "baz": 42,\n  "my_obj": {\n    "my_key": false,\n    "another": true\n  }\n}\n</span><span class="no">JSON</span>\n\n  <span class="n">sshKeys</span> <span class="o">=</span> <span class="p">[</span><span class="s2">"${opc_compute_ssh_key.key1.name}"</span><span class="p">]</span>\n<span class="p">}</span>\n</code></pre></div>',elementType:"div"},{name:"",description:"<p>This allows the user to have full control over the attributes supplied to an instance during instance creation.\nThere are, as well, some attributes that get populated during instance creation, and the full attributes map can be seen\nvia the exported <code>attributes</code> attribute.</p>",elementType:"p"},{name:"",description:'<p><strong>Warning:</strong> Due to how Terraform imports resources, the <code>instance_attributes</code> field will <em>only</em> be populated\nwhen creating a new instance <em>with terraform</em>. This requires us to ignore any state diffs on changes to the <code>instance_attributes</code> field.\nThus, any configuration changes in the <code>instance_attributes</code> field, will not register a diff during a <code>plan</code> or <code>apply</code>.\n If a user wishes to make a change solely to the supplied instance attributes, and recreate the instance resource, <code>terraform taint</code> is the best solution.\n You can read more about the <code>taint</code> command <a href="https://www.terraform.io/docs/commands/taint.html">here</a></p>',elementType:"p"},{name:"networking-info",description:'<h2 id="networking-info">\n<a class="anchor" href="#networking-info" name="networking-info">\xbb</a>\n  Networking Info\n</h2>',elementType:"h2"},{name:"",description:"<p>Each <code>networking_info</code> config manages a single network interface for the instance.\nThe attributes are either required or optional depending on whether or not the interface is\nin the Shared Network, or an IP Network. Some attributes can only be used if the interface is in the Shared\n Network, and same for an interface in an IP Network.</p>",elementType:"p"},{name:"",description:"<p><strong>Note:</strong> If <code>networking_info</code> is left unspecified, the instance will be booted in the <code>shared_network</code>.</p>",elementType:"p"},{name:"",description:"<p>The following attributes are supported:</p>",elementType:"p"},{name:"index",description:"<strong>(Required)</strong> The numerical index of the network interface. Specified as an integer to allow for use of <code>count</code>, but directly maps to <code>ethX</code>. ie: With <code>index</code> set to <code>0</code>, the interface <code>eth0</code> will be created. Can only be <code>0-9</code>.\n",elementType:"li",listDepth:1},{name:"dns",description:"(Optional, IP Network Only) List of DNS A record names for the instance. You can specify up to eight DNS A record names for each interface on an IP network. These names can be queried by instances on any IP network in the same IP network exchange.\n",elementType:"li",listDepth:1},{name:"ip_address",description:"(Optional, IP Network Only) IP Address assigned to the interface.\n",elementType:"li",listDepth:1},{name:"ip_network",description:"(Optional, IP Network Only) The IP Network assigned to the interface.\n",elementType:"li",listDepth:1},{name:"mac_address",description:"(Optional, IP Network Only) The MAC address of the interface.\n",elementType:"li",listDepth:1},{name:"is_default_gateway",description:"(Optional, IP Network Only) Specify the interface is to be used as the default gateway for all traffic. Only one interface on an instance can be specified as the default gateway. If the instance has an interface on the shared network, that interface is always used as the default gateway.\n",elementType:"li",listDepth:1},{name:"model",description:"(Optional, Shared Network Only) The model of the NIC card used. Must be set to <code>e1000</code>.\n",elementType:"li",listDepth:1},{name:"name_servers",description:"<strong>(Optional)</strong> Array of name servers for the interface.\n",elementType:"li",listDepth:1},{name:"nat",description:"(Optional for IP Networks, Required for the Shared Network) The IP Reservations associated with the interface (IP Network).\nIndicates whether a temporary or permanent public IP address should be assigned to the instance (Shared Network).\n",elementType:"li",listDepth:1},{name:"search_domains",description:"<strong>(Optional)</strong> The search domains that are sent through DHCP as option 119.\n",elementType:"li",listDepth:1},{name:"sec_lists",description:"(Optional, Shared Network Only) The security lists the interface is added to.\n",elementType:"li",listDepth:1},{name:"shared_network",description:"<strong>(Required)</strong> Whether or not the interface is inside the Shared Network or an IP Network.\n",elementType:"li",listDepth:1},{name:"vnic",description:"(Optional, IP Network Only) The name of the vNIC created for the IP Network.\n",elementType:"li",listDepth:1},{name:"vnic_sets",description:"(Optional, IP Network Only) The array of vNIC Sets the interface was added to.\n",elementType:"li",listDepth:1},{name:"storage-attachments",description:'<h2 id="storage-attachments">\n<a class="anchor" href="#storage-attachments" name="storage-attachments">\xbb</a>\n  Storage Attachments\n</h2>',elementType:"h2"},{name:"",description:"<p>Each Storage Attachment config manages a single storage attachment that is created <em>during instance creation</em>.\nThis means that any storage attachments created during instance creation cannot be detached from the instance.\nUse the <code>resource_storage_attachment</code> resource to manage storage attachments for instances if you wish to detach the\nstorage volumes at a later date.</p>",elementType:"p"},{name:"",description:"<p>The following attributes are supported:</p>",elementType:"p"},{name:"index",description:"<strong>(Required)</strong> The Index number of the volume attachment. <code>1</code> is the boot volume for the instance. Values <code>1-10</code> allowed.\n",elementType:"li",listDepth:1},{name:"volume",description:"<strong>(Required)</strong> The name of the storage volume to attach to the instance.\n",elementType:"li",listDepth:1},{name:"",description:"<p>In addition to the above attributes, the following attributes are exported for a storage volume</p>",elementType:"p"},{name:"name",description:"Name of the storage volume attachment.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opc/r/opc_compute_instance.html",docType:""},{id:5,type:"  opc_compute_ip_address_association",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the ip address association.</p>\n</li>',elementType:"li",listDepth:1},{name:"ip_address_reservation",description:'<li><p><a name="ip_address_reservation"></a><a href="#ip_address_reservation"><code>ip_address_reservation</code></a> - <strong>(Optional)</strong> The name of the NAT IP address reservation.</p>\n</li>',elementType:"li",listDepth:1},{name:"vnic",description:'<li><p><a name="vnic"></a><a href="#vnic"><code>vnic</code></a> - <strong>(Optional)</strong> The name of the virtual NIC associated with this NAT IP reservation.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> A description of the ip address association.</p>\n</li>',elementType:"li",listDepth:1},{name:"tags",description:'<li><p><a name="tags"></a><a href="#tags"><code>tags</code></a> - <strong>(Optional)</strong> List of tags that may be applied to the ip address association.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>In addition to the above, the following variables are exported:</p>",elementType:"p"},{name:"uri",description:"(Computed) The Uniform Resource Identifier of the ip address association.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opc/r/opc_compute_ip_address_association.html",docType:""},{id:6,type:"  opc_compute_ip_address_prefix_set",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the ip address prefix set.</p>\n</li>',elementType:"li",listDepth:1},{name:"prefixes",description:'<li><p><a name="prefixes"></a><a href="#prefixes"><code>prefixes</code></a> - <strong>(Optional)</strong> List of CIDR IPv4 prefixes assigned in the virtual network.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> A description of the ip address prefix set.</p>\n</li>',elementType:"li",listDepth:1},{name:"tags",description:'<li><p><a name="tags"></a><a href="#tags"><code>tags</code></a> - <strong>(Optional)</strong> List of tags that may be applied to the ip address prefix set.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>In addition to the above, the following variables are exported:</p>",elementType:"p"},{name:"uri",description:"(Computed) The Uniform Resource Identifier of the ip address prefix set.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opc/r/opc_compute_ip_address_prefix_set.html",docType:""},{id:7,type:"  opc_compute_ip_address_reservation",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the ip address reservation.</p>\n</li>',elementType:"li",listDepth:1},{name:"ip_address_pool",description:'<li><p><a name="ip_address_pool"></a><a href="#ip_address_pool"><code>ip_address_pool</code></a> - <strong>(Required)</strong> The IP address pool from which you want to reserve an IP address. Typically one of either <code>public-ippool</code> or <code>cloud-ippool</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> A description of the ip address reservation.</p>\n</li>',elementType:"li",listDepth:1},{name:"tags",description:'<li><p><a name="tags"></a><a href="#tags"><code>tags</code></a> - <strong>(Optional)</strong> List of tags that may be applied to the IP address reservation.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>In addition to the above, the following attributes are exported:</p>",elementType:"p"},{name:"ip_address",description:'<li><p><a name="ip_address"></a><a href="#ip_address"><code>ip_address</code></a> - Reserved NAT IPv4 address from the IP address pool.</p>\n</li>',elementType:"li",listDepth:1},{name:"uri",description:'<li><p><a name="uri"></a><a href="#uri"><code>uri</code></a> - The Uniform Resource Identifier of the ip address reservation</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opc/r/opc_compute_ip_address_reservation.html",docType:""},{id:8,type:"  opc_compute_ip_association",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"vcable",description:'<li><p><a name="vcable"></a><a href="#vcable"><code>vcable</code></a> - <strong>(Required)</strong> The vcable of the instance to associate the IP address with.</p>\n</li>',elementType:"li",listDepth:1},{name:"parent_pool",description:'<li><p><a name="parent_pool"></a><a href="#parent_pool"><code>parent_pool</code></a> - <strong>(Required)</strong> The pool from which to take an IP address. To associate a specific reserved IP address, use\nthe prefix <code>ipreservation:</code> followed by the name of the IP reservation. To allocate an IP address from a pool, use the\nprefix <code>ippool:</code>, e.g. <code>ippool:/oracle/public/ippool</code>.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opc/r/opc_compute_ip_association.html",docType:""},{id:9,type:"  opc_compute_ip_network",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the IP Network. Changing this name forces a new resource to be created.</p>\n</li>',elementType:"li",listDepth:1},{name:"ip_address_prefix",description:'<li><p><a name="ip_address_prefix"></a><a href="#ip_address_prefix"><code>ip_address_prefix</code></a> - <strong>(Required)</strong> The IPv4 address prefix, in CIDR format.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> The description of the IP Network.</p>\n</li>',elementType:"li",listDepth:1},{name:"ip_network_exchange",description:'<li><p><a name="ip_network_exchange"></a><a href="#ip_network_exchange"><code>ip_network_exchange</code></a> - <strong>(Optional)</strong> Specify the IP Network exchange to which the IP Network belongs to.</p>\n</li>',elementType:"li",listDepth:1},{name:"public_napt_enabled",description:'<li><p><a name="public_napt_enabled"></a><a href="#public_napt_enabled"><code>public_napt_enabled</code></a> - <strong>(Optional)</strong> If true, enable public internet access using NAPT for VNICs without any public IP Reservation. Defaults to <code>false</code>.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opc/r/opc_compute_ip_network.html",docType:""},{id:10,type:"  opc_compute_ip_network_exchange",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the ip network exchange.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> A description of the ip network exchange.</p>\n</li>',elementType:"li",listDepth:1},{name:"tags",description:'<li><p><a name="tags"></a><a href="#tags"><code>tags</code></a> - <strong>(Optional)</strong> List of tags that may be applied to the IP network exchange.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opc/r/opc_compute_ip_network_exchange.html",docType:""},{id:11,type:"  opc_compute_ip_reservation",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"permanent",description:'<li><p><a name="permanent"></a><a href="#permanent"><code>permanent</code></a> - <strong>(Required)</strong> Whether the IP address remains reserved even when it is no longer associated with an instance\n(if true), or may be returned to the pool and replaced with a different IP address when an instance is restarted, or\ndeleted and recreated (if false).</p>\n</li>',elementType:"li",listDepth:1},{name:"parent_pool",description:'<li><p><a name="parent_pool"></a><a href="#parent_pool"><code>parent_pool</code></a> - <strong>(Optional)</strong> The pool from which to allocate the IP address. Defaults to <code>/oracle/public/ippool</code>, and is currently the only acceptable input.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Optional)</strong> Name of the IP Reservation. Will be generated if unspecified.</p>\n</li>',elementType:"li",listDepth:1},{name:"tags",description:'<li><p><a name="tags"></a><a href="#tags"><code>tags</code></a> - <strong>(Optional)</strong> List of tags that may be applied to the IP reservation.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opc/r/opc_compute_ip_reservation.html",docType:""},{id:12,type:"  opc_compute_machine_image",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"account",description:'<li><p><a name="account"></a><a href="#account"><code>account</code></a> - <strong>(Required)</strong> The two part name of the compute object storage account in the format <code>/Compute-{identity_domain}/cloud_storage</code></p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the Machine Image.</p>\n</li>',elementType:"li",listDepth:1},{name:"file",description:'<li><p><a name="file"></a><a href="#file"><code>file</code></a> - <strong>(Required)</strong> The name of the Machine Image .tar.gz file in the <code>compute_images</code> storage container.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> A description of the Machine Image.</p>\n</li>',elementType:"li",listDepth:1},{name:"attributes",description:'<li><p><a name="attributes"></a><a href="#attributes"><code>attributes</code></a> - <strong>(Optional)</strong> An optional JSON object of arbitrary attributes to be made available to the instance. These are user-defined tags. After defining attributes, you can view them from within an instance at <a href="http://192.0.0.192/">http://192.0.0.192/</a></p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>In addition to the above, the following values are exported:</p>",elementType:"p"},{name:"error_reason",description:'<li><p><a name="error_reason"></a><a href="#error_reason"><code>error_reason</code></a> - Description of the state of the machine image if there is an error.</p>\n</li>',elementType:"li",listDepth:1},{name:"hypervisor",description:'<li><p><a name="hypervisor"></a><a href="#hypervisor"><code>hypervisor</code></a> -  Dictionary of hypervisor-specific attributes.</p>\n</li>',elementType:"li",listDepth:1},{name:"image_format",description:'<li><p><a name="image_format"></a><a href="#image_format"><code>image_format</code></a> - The format of the image.</p>\n</li>',elementType:"li",listDepth:1},{name:"platform",description:'<li><p><a name="platform"></a><a href="#platform"><code>platform</code></a> - The OS platform of the image.</p>\n</li>',elementType:"li",listDepth:1},{name:"state",description:'<li><p><a name="state"></a><a href="#state"><code>state</code></a> - The state of the uploaded machine image.</p>\n</li>',elementType:"li",listDepth:1},{name:"uri",description:'<li><p><a name="uri"></a><a href="#uri"><code>uri</code></a> - The Uniform Resource Identifier for the Machine Image.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opc/r/opc_compute_machine_image.html",docType:""},{id:13,type:"  opc_compute_orchestrated_instance",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the orchestration.</p>\n</li>',elementType:"li",listDepth:1},{name:"list description",description:'<p><a name="desired_state"></a><a href="#desired_state"><code>desired_state</code></a> - (Required) The desired state of the orchestration. Permitted values are:</p>',elementType:"p"},{name:"active",description:": all resource (instances) declared in the orchestration are created\n",elementType:"li",listDepth:2},{name:"suspend",description:": all resources (instances) declared in the orchestration are removed unless the instances has\n<code>persistent = true</code>\n",elementType:"li",listDepth:2},{name:"inactive",description:":  all resources (instances) declared in the orchestration are removed including the instances that have\n<code>persistent = true</code>\n",elementType:"li",listDepth:2},{name:"instance",description:'<li><p><a name="instance"></a><a href="#instance"><code>instance</code></a> - <strong>(Required)</strong> The information pertaining to creating an instance through the orchestration API.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> The description of the orchestration.</p>\n</li>',elementType:"li",listDepth:1},{name:"instance-1",description:'<h2 id="instance-1">\n<a class="anchor" href="#instance-1" name="instance-1">\xbb</a>\n  Instance\n</h2>',elementType:"h2"},{name:"",description:'<p>Instance supports the arguments found in <a href="https://www.terraform.io/docs/providers/opc/r/opc_compute_instance.html">opc_compute_instance</a>\nand the following:</p>',elementType:"p"},{name:"persistent",description:"<strong>(Optional)</strong> Determines whether the instance will persist when the orchestration is suspended.\nDefaults to false.\n",elementType:"li",listDepth:1},{name:"",description:"<p>In addition to the above, the following values are exported:</p>",elementType:"p"},{name:"uri",description:'<li><p><a name="uri"></a><a href="#uri"><code>uri</code></a> - The Uniform Resource Identifier for the Orchestration</p>\n</li>',elementType:"li",listDepth:1},{name:"version",description:'<li><p><a name="version"></a><a href="#version"><code>version</code></a> - <strong>(Optional)</strong> The version of the orchestration.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opc/r/opc_compute_orchestrated_instance.html",docType:""},{id:14,type:"  opc_compute_route",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the route.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> The description of the route.</p>\n</li>',elementType:"li",listDepth:1},{name:"admin_distance",description:'<li><p><a name="admin_distance"></a><a href="#admin_distance"><code>admin_distance</code></a> - <strong>(Optional)</strong> The route\'s administrative distance. Defaults to <code>0</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"ip_address_prefix",description:'<li><p><a name="ip_address_prefix"></a><a href="#ip_address_prefix"><code>ip_address_prefix</code></a> - <strong>(Required)</strong> The IPv4 address prefix, in CIDR format, of the external network from which to route traffic.</p>\n</li>',elementType:"li",listDepth:1},{name:"next_hop_vnic_set",description:'<li><p><a name="next_hop_vnic_set"></a><a href="#next_hop_vnic_set"><code>next_hop_vnic_set</code></a> - <strong>(Required)</strong> Name of the virtual NIC set to route matching packets to. Routed flows are load-balanced among all the virtual NICs in the virtual NIC set.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opc/r/opc_compute_route.html",docType:""},{id:15,type:"  opc_compute_sec_rule",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The unique (within the identity domain) name of the security rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> A description for this security rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"list description",description:'<p><a name="source_list"></a><a href="#source_list"><code>source_list</code></a> - (Required) The source security list (prefixed with <code>seclist:</code>), or security IP list (prefixed with\n<code>seciplist:</code>).</p>',elementType:"p"},{name:"destination_list",description:"<strong>(Required)</strong> The destination security list (prefixed with <code>seclist:</code>), or security IP list (prefixed with\n<code>seciplist:</code>).\n",elementType:"li",listDepth:2},{name:"application",description:'<li><p><a name="application"></a><a href="#application"><code>application</code></a> - <strong>(Required)</strong> The name of the application to which the rule applies.</p>\n</li>',elementType:"li",listDepth:1},{name:"action",description:'<li><p><a name="action"></a><a href="#action"><code>action</code></a> - <strong>(Required)</strong> Whether to <code>permit</code>, <code>refuse</code> or <code>deny</code> packets to which this rule applies. This will ordinarily\nbe <code>permit</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"disabled",description:'<li><p><a name="disabled"></a><a href="#disabled"><code>disabled</code></a> - <strong>(Optional)</strong> Whether to disable this security rule. This is useful if you want to temporarily disable a rule\nwithout removing it outright from your Terraform resource definition. Defaults to <code>false</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>In addition to the above, the following values are exported:</p>",elementType:"p"},{name:"uri",description:"The Uniform Resource Identifier of the sec rule.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opc/r/opc_compute_sec_rule.html",docType:""},{id:16,type:"  opc_compute_security_application",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The unique (within the identity domain) name of the application</p>\n</li>',elementType:"li",listDepth:1},{name:"protocol",description:'<li><p><a name="protocol"></a><a href="#protocol"><code>protocol</code></a> - <strong>(Required)</strong> The protocol to enable for this application. Must be one of\n<code>tcp</code>, <code>udp</code>, <code>ah</code>, <code>esp</code>, <code>icmp</code>, <code>icmpv6</code>, <code>igmp</code>, <code>ipip</code>, <code>gre</code>, <code>mplsip</code>, <code>ospf</code>, <code>pim</code>, <code>rdp</code>, <code>sctp</code> or <code>all</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"dport",description:'<li><p><a name="dport"></a><a href="#dport"><code>dport</code></a> - <strong>(Required)</strong> The port, or range of ports, to enable for this application, e.g <code>8080</code>, <code>6000-7000</code>. This must be set if the <code>protocol</code> is set to <code>tcp</code> or <code>udp</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"icmptype",description:'<li><p><a name="icmptype"></a><a href="#icmptype"><code>icmptype</code></a> - <strong>(Optional)</strong> The ICMP type to enable for this application, if the <code>protocol</code> is <code>icmp</code>. Must be one of\n<code>echo</code>, <code>reply</code>, <code>ttl</code>, <code>traceroute</code>, <code>unreachable</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"icmpcode",description:'<li><p><a name="icmpcode"></a><a href="#icmpcode"><code>icmpcode</code></a> - <strong>(Optional)</strong> The ICMP code to enable for this application, if the <code>protocol</code> is <code>icmp</code>. Must be one of\n<code>admin</code>, <code>df</code>, <code>host</code>, <code>network</code>, <code>port</code> or <code>protocol</code>.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opc/r/opc_compute_security_application.html",docType:""},{id:17,type:"  opc_compute_security_association",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Optional)</strong> The Name for the Security Association. If not specified, one is created automatically. Changing this forces a new resource to be created.</p>\n</li>',elementType:"li",listDepth:1},{name:"vcable",description:'<li><p><a name="vcable"></a><a href="#vcable"><code>vcable</code></a> - <strong>(Required)</strong> The <code>vcable</code> of the instance to associate to the security list.</p>\n</li>',elementType:"li",listDepth:1},{name:"seclist",description:'<li><p><a name="seclist"></a><a href="#seclist"><code>seclist</code></a> - <strong>(Required)</strong> The name of the security list to associate the instance to.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opc/r/opc_compute_security_association.html",docType:""},{id:18,type:"  opc_compute_security_ip_list",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The unique (within the identity domain) name of the security IP list.</p>\n</li>',elementType:"li",listDepth:1},{name:"ip_entries",description:'<li><p><a name="ip_entries"></a><a href="#ip_entries"><code>ip_entries</code></a> - <strong>(Required)</strong> The IP addresses to include in the list.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> The description of the security ip list.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opc/r/opc_compute_security_ip_list.html",docType:""},{id:19,type:"  opc_compute_security_list",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The unique (within the identity domain) name of the security list.</p>\n</li>',elementType:"li",listDepth:1},{name:"policy",description:'<li><p><a name="policy"></a><a href="#policy"><code>policy</code></a> - <strong>(Required)</strong> The policy to apply to instances associated with this list. Must be one of <code>permit</code>,\n<code>reject</code> (packets are dropped but a reply is sent) and <code>deny</code> (packets are dropped and no reply is sent).</p>\n</li>',elementType:"li",listDepth:1},{name:"output_cidr_policy",description:'<li><p><a name="output_cidr_policy"></a><a href="#output_cidr_policy"><code>output_cidr_policy</code></a> - <strong>(Required)</strong> The policy for outbound traffic from the security list. Must be one of <code>permit</code>,\n<code>reject</code> (packets are dropped but a reply is sent) and <code>deny</code> (packets are dropped and no reply is sent).</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opc/r/opc_compute_security_list.html",docType:""},{id:20,type:"  opc_compute_security_protocol",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the security protocol.</p>\n</li>',elementType:"li",listDepth:1},{name:"dst_ports",description:'<li><p><a name="dst_ports"></a><a href="#dst_ports"><code>dst_ports</code></a> <strong>(Optional)</strong> Enter a list of port numbers or port range strings.\nTraffic is enabled by a security rule when a packet\'s destination port matches the\nports specified here.\nFor TCP, SCTP, and UDP, each port is a destination transport port, between 0 and 65535,\ninclusive. For ICMP, each port is an ICMP type, between 0 and 255, inclusive.\nIf no destination ports are specified, all destination ports or ICMP types are allowed.</p>\n</li>',elementType:"li",listDepth:1},{name:"src_ports",description:'<li><p><a name="src_ports"></a><a href="#src_ports"><code>src_ports</code></a> <strong>(Optional)</strong> Enter a list of port numbers or port range strings.\nTraffic is enabled by a security rule when a packet\'s source port matches the\nports specified here.\nFor TCP, SCTP, and UDP, each port is a source transport port,\nbetween 0 and 65535, inclusive.\nFor ICMP, each port is an ICMP type, between 0 and 255, inclusive.\nIf no source ports are specified, all source ports or ICMP types are allowed.</p>\n</li>',elementType:"li",listDepth:1},{name:"ip_protocol",description:'<li><p><a name="ip_protocol"></a><a href="#ip_protocol"><code>ip_protocol</code></a> <strong>(Optional)</strong> The protocol used in the data portion of the IP datagram.\n Permitted values are: tcp, udp, icmp, igmp, ipip, rdp, esp, ah, gre, icmpv6, ospf, pim, sctp,\n mplsip, all.\n Traffic is enabled by a security rule when the protocol in the packet matches the\n protocol specified here. If no protocol is specified, all protocols are allowed.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> A description of the security protocol.</p>\n</li>',elementType:"li",listDepth:1},{name:"tags",description:'<li><p><a name="tags"></a><a href="#tags"><code>tags</code></a> - <strong>(Optional)</strong> List of tags that may be applied to the security protocol.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>In addition to the above, the following values are exported:</p>",elementType:"p"},{name:"uri",description:"The Uniform Resource Identifier for the Security Protocol\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opc/r/opc_compute_security_protocol.html",docType:""},{id:21,type:"  opc_compute_security_rule",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the security rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"flow_direction",description:'<li><p><a name="flow_direction"></a><a href="#flow_direction"><code>flow_direction</code></a> - <strong>(Required)</strong> Specify the direction of flow of traffic, which is relative to the instances, for this security rule. Allowed values are ingress or egress.</p>\n</li>',elementType:"li",listDepth:1},{name:"disabled",description:'<li><p><a name="disabled"></a><a href="#disabled"><code>disabled</code></a> - <strong>(Optional)</strong> Whether to disable this security rule. This is useful if you want to temporarily disable a rule without removing it outright from your Terraform resource definition. Defaults to <code>false</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"acl",description:'<li><p><a name="acl"></a><a href="#acl"><code>acl</code></a> - <strong>(Optional)</strong> Name of the ACL that contains this security rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"dst_ip_address_prefixes",description:'<li><p><a name="dst_ip_address_prefixes"></a><a href="#dst_ip_address_prefixes"><code>dst_ip_address_prefixes</code></a> - <strong>(Optional)</strong> List of IP address prefix set names to match the packet\'s destination IP address.</p>\n</li>',elementType:"li",listDepth:1},{name:"src_ip_address_prefixes",description:'<li><p><a name="src_ip_address_prefixes"></a><a href="#src_ip_address_prefixes"><code>src_ip_address_prefixes</code></a> - <strong>(Optional)</strong> List of names of IP address prefix set to match the packet\'s source IP address.</p>\n</li>',elementType:"li",listDepth:1},{name:"dst_vnic_set",description:'<li><p><a name="dst_vnic_set"></a><a href="#dst_vnic_set"><code>dst_vnic_set</code></a> - <strong>(Optional)</strong> Name of virtual NIC set containing the packet\'s destination virtual NIC.</p>\n</li>',elementType:"li",listDepth:1},{name:"src_vnic_set",description:'<li><p><a name="src_vnic_set"></a><a href="#src_vnic_set"><code>src_vnic_set</code></a> - <strong>(Optional)</strong> Name of virtual NIC set containing the packet\'s source virtual NIC.</p>\n</li>',elementType:"li",listDepth:1},{name:"security_protocols",description:'<li><p><a name="security_protocols"></a><a href="#security_protocols"><code>security_protocols</code></a> - <strong>(Optional)</strong> List of security protocol object names to match the packet\'s protocol and port.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> A description of the security rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"tags",description:'<li><p><a name="tags"></a><a href="#tags"><code>tags</code></a> - <strong>(Optional)</strong> List of tags that may be applied to the security rule.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opc/r/opc_compute_security_rule.html",docType:""},{id:22,type:"  opc_compute_ssh_key",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The unique (within this identity domain) name of the SSH key.</p>\n</li>',elementType:"li",listDepth:1},{name:"key",description:'<li><p><a name="key"></a><a href="#key"><code>key</code></a> - <strong>(Required)</strong> The SSH key itself</p>\n</li>',elementType:"li",listDepth:1},{name:"enabled",description:'<li><p><a name="enabled"></a><a href="#enabled"><code>enabled</code></a> - <strong>(Optional)</strong> Whether or not the key is enabled. This is useful if you want to temporarily disable an SSH key,\nwithout removing it entirely from your Terraform resource definition. Defaults to <code>true</code></p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opc/r/opc_compute_ssh_key.html",docType:""},{id:23,type:"  opc_compute_storage_volume_attachment",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"instance",description:'<li><p><a name="instance"></a><a href="#instance"><code>instance</code></a> - <strong>(Required)</strong> The name of the instance the volume will be attached to.</p>\n</li>',elementType:"li",listDepth:1},{name:"storage_volume",description:'<li><p><a name="storage_volume"></a><a href="#storage_volume"><code>storage_volume</code></a> - <strong>(Required)</strong> The name of the storage volume that will be attached to the\ninstance</p>\n</li>',elementType:"li",listDepth:1},{name:"index",description:'<li><p><a name="index"></a><a href="#index"><code>index</code></a> - <strong>(Required)</strong> The index on the instance that the storage volume will be attached to.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opc/r/opc_compute_storage_volume_attachment.html",docType:""},{id:24,type:"  opc_compute_storage_volume",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:" <strong>(Required)</strong> The name for the Storage Account.\n",elementType:"li",listDepth:1},{name:"description",description:" <strong>(Optional)</strong> The description of the storage volume.\n",elementType:"li",listDepth:1},{name:"size",description:" <strong>(Required)</strong> The size of this storage volume in GB. The allowed range is from 1 GB to 2 TB (2048 GB).\n",elementType:"li",listDepth:1},{name:"storage_type",description:"<strong>(Optional)</strong>",elementType:"li",listDepth:1},{name:"bootable",description:"<strong>(Optional)</strong> Is the Volume Bootable? Defaults to <code>false</code>.\n",elementType:"li",listDepth:1},{name:"image_list",description:"<strong>(Optional)</strong> Defines an image list.\n",elementType:"li",listDepth:1},{name:"image_list_entry",description:"<strong>(Optional)</strong> Defines an image list entry.\n",elementType:"li",listDepth:1},{name:"snapshot",description:'<strong>(Optional)</strong> The name of the parent snapshot from which the storage volume is restored or cloned. See <a href="#snapshots">Snapshots</a>, below for more information.\n',elementType:"li",listDepth:1},{name:"snapshot_id",description:'<strong>(Optional)</strong> The Id of the parent snapshot from which the storage volume is restored or cloned. See <a href="#snapshots">Snapshots</a>, below for more information.\n',elementType:"li",listDepth:1},{name:"snapshot_account",description:'<strong>(Optional)</strong> The Account of the parent snapshot from which the storage volume is restored. See <a href="#snapshots">Snapshots</a>, below for more information.\n',elementType:"li",listDepth:1},{name:"tags",description:"<strong>(Optional)</strong> Comma-separated strings that tag the storage volume.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opc/r/opc_compute_storage_volume.html",docType:""},{id:25,type:"  opc_compute_storage_volume_snapshot",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"volume_name",description:" <strong>(Required)</strong> The name of the storage volume to create the snapshot from.\n",elementType:"li",listDepth:1},{name:"description",description:" <strong>(Optional)</strong> The description of the storage volume snapshot.\n",elementType:"li",listDepth:1},{name:"name",description:" <strong>(Optional)</strong> The name of the storage volume snapshot. Will be generated if unspecified.\n",elementType:"li",listDepth:1},{name:"parent_volume_bootable",description:" <strong>(Optional)</strong> A string value of whether or not the parent volume is 'bootable' or not. Defaults to <code>\"false\"</code>.\n",elementType:"li",listDepth:1},{name:"collocated",description:" <strong>(Optional)</strong> Boolean specifying whether the snapshot is collocated or remote. Defaults to <code>false</code>.\n",elementType:"li",listDepth:1},{name:"tags",description:"<strong>(Optional)</strong> Comma-separated strings that tag the storage volume.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opc/r/opc_compute_storage_volume_snapshot.html",docType:""},{id:26,type:"  opc_compute_vnic_set",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The unique (within this identity domain) name of the virtual nic set.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> A description of the virtual nic set.</p>\n</li>',elementType:"li",listDepth:1},{name:"applied_acls",description:'<li><p><a name="applied_acls"></a><a href="#applied_acls"><code>applied_acls</code></a> - <strong>(Optional)</strong> A list of the ACLs to apply to the virtual nics in the set.</p>\n</li>',elementType:"li",listDepth:1},{name:"virtual_nics",description:'<li><p><a name="virtual_nics"></a><a href="#virtual_nics"><code>virtual_nics</code></a> - <strong>(Optional)</strong> List of virtual NICs associated with this virtual NIC set.</p>\n</li>',elementType:"li",listDepth:1},{name:"tags",description:'<li><p><a name="tags"></a><a href="#tags"><code>tags</code></a> - <strong>(Optional)</strong> A list of tags to apply to the storage volume.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opc/r/opc_compute_vnic_set.html",docType:""},{id:27,type:"  opc_compute_vpn_endpoint_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the VPN Endpoint V2.</p>\n</li>',elementType:"li",listDepth:1},{name:"customer_vpn_gateway",description:'<li><p><a name="customer_vpn_gateway"></a><a href="#customer_vpn_gateway"><code>customer_vpn_gateway</code></a> - <strong>(Required)</strong> The ip address of the VPN gateway in your data center through which you want to connect to the Oracle Cloud VPN gateway.</p>\n</li>',elementType:"li",listDepth:1},{name:"ip_network",description:'<li><p><a name="ip_network"></a><a href="#ip_network"><code>ip_network</code></a> - <strong>(Required)</strong> The name of the IP network on which the cloud gateway is created by VPNaaS.</p>\n</li>',elementType:"li",listDepth:1},{name:"pre_shared_key",description:'<li><p><a name="pre_shared_key"></a><a href="#pre_shared_key"><code>pre_shared_key</code></a> - <strong>(Required)</strong> The pre-shared VPN key</p>\n</li>',elementType:"li",listDepth:1},{name:"reachable_routes",description:'<li><p><a name="reachable_routes"></a><a href="#reachable_routes"><code>reachable_routes</code></a> - <strong>(Required)</strong> A list of routes (CIDR prefixes) that are reachable through this VPN tunnel.</p>\n</li>',elementType:"li",listDepth:1},{name:"vnic_sets",description:'<li><p><a name="vnic_sets"></a><a href="#vnic_sets"><code>vnic_sets</code></a> - <strong>(Required)</strong> A list of vnic sets that traffics is allowed to and from.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> A description of the VPN Endpoint V2.</p>\n</li>',elementType:"li",listDepth:1},{name:"enabled",description:'<li><p><a name="enabled"></a><a href="#enabled"><code>enabled</code></a> - <strong>(Optional)</strong> Enables or disables the VPN Endpoint V2. Set to true by default.</p>\n</li>',elementType:"li",listDepth:1},{name:"ike_identifier",description:'<li><p><a name="ike_identifier"></a><a href="#ike_identifier"><code>ike_identifier</code></a> - <strong>(Optional)</strong> The Internet Key Exchange (IKE) ID. If you don\'t specify a value, the default value is the public IP address of the cloud gateway.</p>\n</li>',elementType:"li",listDepth:1},{name:"require_perfect_forward_secrecy",description:'<li><p><a name="require_perfect_forward_secrecy"></a><a href="#require_perfect_forward_secrecy"><code>require_perfect_forward_secrecy</code></a> - <strong>(Optional)</strong> Boolean specifying whether Perfect Forward Secrecy is enabled. Set to true by default.</p>\n</li>',elementType:"li",listDepth:1},{name:"phase_one_settings",description:'<li><p><a name="phase_one_settings"></a><a href="#phase_one_settings"><code>phase_one_settings</code></a> - <strong>(Optional)</strong> Settings for the phase one protocol (IKE). Phase One Settings are detailed below.</p>\n</li>',elementType:"li",listDepth:1},{name:"phase_two_settings",description:'<li><p><a name="phase_two_settings"></a><a href="#phase_two_settings"><code>phase_two_settings</code></a> - <strong>(Optional)</strong> Settings for the phase two protocol (IPSEC). Phase Two Settings are detailed below.</p>\n</li>',elementType:"li",listDepth:1},{name:"tags",description:'<li><p><a name="tags"></a><a href="#tags"><code>tags</code></a> - <strong>(Optional)</strong> List of tags that may be applied to the VPN Endpoint V2.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>Phase One Settings support the following:</p>",elementType:"p"},{name:"encryption",description:'<li><p><a name="encryption"></a><a href="#encryption"><code>encryption</code></a> - <strong>(Required)</strong> IKE Encryption. <code>aes128</code>, <code>aes192</code> or <code>aes256</code></p>\n</li>',elementType:"li",listDepth:1},{name:"hash",description:'<li><p><a name="hash"></a><a href="#hash"><code>hash</code></a> - <strong>(Required)</strong> IKE Hash. <code>sha1</code>, <code>sha2_256</code> or <code>md5</code></p>\n</li>',elementType:"li",listDepth:1},{name:"dh_group",description:'<li><p><a name="dh_group"></a><a href="#dh_group"><code>dh_group</code></a> - <strong>(Required)</strong> Diffie-Hellman group for both IKE and ESP. <code>group2</code>, <code>group5</code>, <code>group14</code>, <code>group22</code>, <code>group23</code>, or <code>group24</code></p>\n</li>',elementType:"li",listDepth:1},{name:"lifetime",description:'<li><p><a name="lifetime"></a><a href="#lifetime"><code>lifetime</code></a> - <strong>(Optional)</strong> IKE Lifetime in seconds.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>Phase Two Settings support the following:</p>",elementType:"p"},{name:"encryption",description:'<li><p><a name="encryption-1"></a><a href="#encryption-1"><code>encryption</code></a> - <strong>(Required)</strong> ESP Encryption.  <code>aes128</code>, <code>aes192</code> or <code>aes256</code></p>\n</li>',elementType:"li",listDepth:1},{name:"hash",description:'<li><p><a name="hash-1"></a><a href="#hash-1"><code>hash</code></a> - <strong>(Required)</strong> ESP Hash. <code>sha1</code>, <code>sha2_256</code> or <code>md5</code></p>\n</li>',elementType:"li",listDepth:1},{name:"lifetime",description:'<li><p><a name="lifetime-1"></a><a href="#lifetime-1"><code>lifetime</code></a> - <strong>(Optional)</strong> IPSEC Lifetime in seconds.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>In addition to the above, the following values are exported:</p>",elementType:"p"},{name:"local_gateway_ip_address",description:'<li><p><a name="local_gateway_ip_address"></a><a href="#local_gateway_ip_address"><code>local_gateway_ip_address</code></a> - Public IP Address of the Local Gateway.</p>\n</li>',elementType:"li",listDepth:1},{name:"local_gateway_private_ip_address",description:'<li><p><a name="local_gateway_private_ip_address"></a><a href="#local_gateway_private_ip_address"><code>local_gateway_private_ip_address</code></a> - Private IP Address of the Local Gateway.</p>\n</li>',elementType:"li",listDepth:1},{name:"uri",description:'<li><p><a name="uri"></a><a href="#uri"><code>uri</code></a> - The Uniform Resource Identifier for the VPN Endpoint V2.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opc/r/opc_compute_vpn_endpoint_v2.html",docType:""},{id:28,type:"  opc_lbaas_certificate",properties:[{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the Certificate.</p>\n</li>',elementType:"li",listDepth:1},{name:"certificate_body",description:'<li><p><a name="certificate_body"></a><a href="#certificate_body"><code>certificate_body</code></a> - <strong>(Required)</strong> The Certificate data in PEM format.</p>\n</li>',elementType:"li",listDepth:1},{name:"type",description:'<li><p><a name="type"></a><a href="#type"><code>type</code></a> - <strong>(Required)</strong> Sets the Certificate Type. <code>TRUSTED</code> or <code>SERVER</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"certificate_chain",description:'<li><p><a name="certificate_chain"></a><a href="#certificate_chain"><code>certificate_chain</code></a> - <strong>(Optional)</strong> PEM encoded bodies of all certificates in the chain up to and including the CA certificate. This is not need when the certificate is self signed.</p>\n</li>',elementType:"li",listDepth:1},{name:"private_key",description:'<li><p><a name="private_key"></a><a href="#private_key"><code>private_key</code></a> - <strong>(Optional)</strong> The private key data in PEM format. Only required for Server Certificates</p>\n</li>',elementType:"li",listDepth:1},{name:"additional-attributes",description:'<h2 id="additional-attributes">\n<a class="anchor" href="#additional-attributes" name="additional-attributes">\xbb</a>\n  Additional Attributes\n</h2>',elementType:"h2"},{name:"",description:"<p>In addition to the above, the following values are exported:</p>",elementType:"p"},{name:"state",description:'<li><p><a name="state"></a><a href="#state"><code>state</code></a> - The State of the Digital Certificate resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"uri",description:'<li><p><a name="uri"></a><a href="#uri"><code>uri</code></a> - The Uniform Resource Identifier for the Certificate resource.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opc/r/opc_lbaas_certificate.html",docType:""},{id:29,type:"  opc_lbaas_listener",properties:[{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the Listener.</p>\n</li>',elementType:"li",listDepth:1},{name:"load_balancer",description:'<li><p><a name="load_balancer"></a><a href="#load_balancer"><code>load_balancer</code></a> - <strong>(Required)</strong> The parent Load Balancer the Listener.</p>\n</li>',elementType:"li",listDepth:1},{name:"balancer_protocol",description:'<li><p><a name="balancer_protocol"></a><a href="#balancer_protocol"><code>balancer_protocol</code></a> - <strong>(Required)</strong>  transport protocol that will be accepted for all incoming requests to the selected load balancer listener. <code>HTTP</code> or <code>HTTPS</code>. If set to HTTPS then you must also set the server <code>certificates</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"port",description:'<li><p><a name="port"></a><a href="#port"><code>port</code></a> - <strong>(Required)</strong> The port on which the Load Balancer is listening.</p>\n</li>',elementType:"li",listDepth:1},{name:"server_protocol",description:'<li><p><a name="server_protocol"></a><a href="#server_protocol"><code>server_protocol</code></a> - <strong>(Required)</strong> The protocol to be used for routing traffic to the origin servers in the server pool. <code>HTTP</code> or <code>HTTPS</code>. If set to <code>HTTPS</code> then you must include a Trusted Certificate Policy in the <code>policies</code></p>\n</li>',elementType:"li",listDepth:1},{name:"enabled",description:'<li><p><a name="enabled"></a><a href="#enabled"><code>enabled</code></a> - <strong>(Optional)</strong> Boolean flag to enable or disable the Listener. Default is <code>true</code> (enabled).</p>\n</li>',elementType:"li",listDepth:1},{name:"path_prefixes",description:'<li><p><a name="path_prefixes"></a><a href="#path_prefixes"><code>path_prefixes</code></a> - <strong>(Optional)</strong> List of paths to configure the listener to accept only requests that are targeted to a specific path within the URI of the request.</p>\n</li>',elementType:"li",listDepth:1},{name:"polices",description:'<li><p><a name="polices"></a><a href="#polices"><code>polices</code></a> - <strong>(Optional)</strong> List of the Load Balancer Policy URIs to apply to the listener.</p>\n</li>',elementType:"li",listDepth:1},{name:"server_pool",description:'<li><p><a name="server_pool"></a><a href="#server_pool"><code>server_pool</code></a> - <strong>(Optional)</strong> URI of the Server Pool resource to which the load balancer distributes requests.</p>\n</li>',elementType:"li",listDepth:1},{name:"certificates",description:'<li><p><a name="certificates"></a><a href="#certificates"><code>certificates</code></a> - <strong>(Optional)</strong> The URI of the server security certificate.</p>\n</li>',elementType:"li",listDepth:1},{name:"tags",description:'<li><p><a name="tags"></a><a href="#tags"><code>tags</code></a> - <strong>(Optional)</strong> List of tags.</p>\n</li>',elementType:"li",listDepth:1},{name:"virtual_hosts",description:'<li><p><a name="virtual_hosts"></a><a href="#virtual_hosts"><code>virtual_hosts</code></a> - <strong>(Optional)</strong> Configure the listener to only accept URI requests that include the host names listed in this field.</p>\n</li>',elementType:"li",listDepth:1},{name:"additional-attributes",description:'<h2 id="additional-attributes">\n<a class="anchor" href="#additional-attributes" name="additional-attributes">\xbb</a>\n  Additional Attributes\n</h2>',elementType:"h2"},{name:"",description:"<p>In addition to the above, the following values are exported:</p>",elementType:"p"},{name:"operational_details",description:'<li><p><a name="operational_details"></a><a href="#operational_details"><code>operational_details</code></a> - Description of the operational state.</p>\n</li>',elementType:"li",listDepth:1},{name:"parent_listener",description:'<li><p><a name="parent_listener"></a><a href="#parent_listener"><code>parent_listener</code></a> - The parent Listener.</p>\n</li>',elementType:"li",listDepth:1},{name:"state",description:'<li><p><a name="state"></a><a href="#state"><code>state</code></a> - State of the Origin Server Pool.</p>\n</li>',elementType:"li",listDepth:1},{name:"uri",description:'<li><p><a name="uri"></a><a href="#uri"><code>uri</code></a> - The Uniform Resource Identifier for the Listner.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opc/r/opc_lbaas_listener.html",docType:""},{id:30,type:"  opc_lbaas_load_balancer",properties:[{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the Load Balancer.</p>\n</li>',elementType:"li",listDepth:1},{name:"region",description:'<li><p><a name="region"></a><a href="#region"><code>region</code></a> - <strong>(Required)</strong> The region in which to create the Load Balancer, e.g. <code>uscom-central-1</code></p>\n</li>',elementType:"li",listDepth:1},{name:"list description",description:'<p><a name="scheme"></a><a href="#scheme"><code>scheme</code></a> - (Required) Set to either <code>INTERNET_FACING</code> or <code>INTERNAL</code></p>',elementType:"p"},{name:"INTERNET_FACING",description:"Create an internet-facing load balancer in a given IP network.\n",elementType:"li",listDepth:2},{name:"INTERNAL",description:"Create an internal load balancer in a given IP network for sole consumption of other clients inside the same network.\n",elementType:"li",listDepth:2},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> A short description for the load balancer. The description must not exceed 1000 characters.</p>\n</li>',elementType:"li",listDepth:1},{name:"enabled",description:'<li><p><a name="enabled"></a><a href="#enabled"><code>enabled</code></a> - <strong>(Optional)</strong> Boolean flag to enable or disable the Load Balancer. Default is <code>true</code> (enabled).</p>\n</li>',elementType:"li",listDepth:1},{name:"ip_network",description:'<li><p><a name="ip_network"></a><a href="#ip_network"><code>ip_network</code></a> - <strong>(Optional)</strong> Fully qualified three part name of the IP network to be associated with the load balancer.</p>\n</li>',elementType:"li",listDepth:1},{name:"parent_load_balancer",description:'<li><p><a name="parent_load_balancer"></a><a href="#parent_load_balancer"><code>parent_load_balancer</code></a> - <strong>(Optional)</strong> Select a parent load balancer if you want to create a dependent load balancer.</p>\n</li>',elementType:"li",listDepth:1},{name:"permitted_clients",description:'<li><p><a name="permitted_clients"></a><a href="#permitted_clients"><code>permitted_clients</code></a> - <strong>(Optional)</strong> List of permitted client IP addresses or CIDR ranges which can connect to this load balancer on the configured Listener ports. If not set all connections are permitted.</p>\n</li>',elementType:"li",listDepth:1},{name:"permitted_methods",description:'<li><p><a name="permitted_methods"></a><a href="#permitted_methods"><code>permitted_methods</code></a> - <strong>(Optional)</strong> List of permitted HTTP methods. e.g. <code>GET</code>, <code>POST</code>, <code>PUT</code>, <code>PATCH</code>, <code>DELETE</code>, <code>HEAD</code> or you can also create your own custom methods. Requests with methods not listed in this field will result in a 403 (unauthorized access) response.</p>\n</li>',elementType:"li",listDepth:1},{name:"tags",description:'<li><p><a name="tags"></a><a href="#tags"><code>tags</code></a> - <strong>(Optional)</strong> List of tags.</p>\n</li>',elementType:"li",listDepth:1},{name:"additional-attributes",description:'<h2 id="additional-attributes">\n<a class="anchor" href="#additional-attributes" name="additional-attributes">\xbb</a>\n  Additional Attributes\n</h2>',elementType:"h2"},{name:"",description:"<p>In addition to the above, the following values are exported:</p>",elementType:"p"},{name:"operational_details",description:'<li><p><a name="operational_details"></a><a href="#operational_details"><code>operational_details</code></a> - Description of the operational state.</p>\n</li>',elementType:"li",listDepth:1},{name:"state",description:'<li><p><a name="state"></a><a href="#state"><code>state</code></a> - State of the Origin Server Pool.</p>\n</li>',elementType:"li",listDepth:1},{name:"status",description:'<li><p><a name="status"></a><a href="#status"><code>status</code></a> - Status of the Origin Server Pool.</p>\n</li>',elementType:"li",listDepth:1},{name:"uri",description:'<li><p><a name="uri"></a><a href="#uri"><code>uri</code></a> - The Uniform Resource Identifier for the Load Balancer.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opc/r/opc_lbaas_load_balancer.html",docType:""},{id:31,type:"  opc_lbaas_policy",properties:[{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the Listener.</p>\n</li>',elementType:"li",listDepth:1},{name:"load_balancer",description:'<li><p><a name="load_balancer"></a><a href="#load_balancer"><code>load_balancer</code></a> - <strong>(Required)</strong> The parent Load Balancer the Listener.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>Include one, and only one, of:</p>",elementType:"p"},{name:"application_cookie_stickiness_policy",description:'<li><p><a name="application_cookie_stickiness_policy"></a><a href="#application_cookie_stickiness_policy"><code>application_cookie_stickiness_policy</code></a> - see <a href="#application-cookie-stickiness-policy">Application Cookie Stickiness Policy</a></p>\n</li>',elementType:"li",listDepth:1},{name:"cloudgate_policy",description:'<li><p><a name="cloudgate_policy"></a><a href="#cloudgate_policy"><code>cloudgate_policy</code></a> - see <a href="#cloudgate-policy">CloudGate Policy</a></p>\n</li>',elementType:"li",listDepth:1},{name:"load_balancer_cookie_stickiness_policy",description:'<li><p><a name="load_balancer_cookie_stickiness_policy"></a><a href="#load_balancer_cookie_stickiness_policy"><code>load_balancer_cookie_stickiness_policy</code></a> - see <a href="#load-balancer-cookie-stickiness-policy">Load Balancer Cookie Stickiness Policy</a></p>\n</li>',elementType:"li",listDepth:1},{name:"load_balancing_mechanism_policy",description:'<li><p><a name="load_balancing_mechanism_policy"></a><a href="#load_balancing_mechanism_policy"><code>load_balancing_mechanism_policy</code></a> - see <a href="#load-balancing-mechanism-policy">Load Balancing Mechanism Policy</a></p>\n</li>',elementType:"li",listDepth:1},{name:"rate_limiting_request_policy",description:'<li><p><a name="rate_limiting_request_policy"></a><a href="#rate_limiting_request_policy"><code>rate_limiting_request_policy</code></a> - see <a href="#rate-limiting-request-policy">Rate Limiting Request Policy</a></p>\n</li>',elementType:"li",listDepth:1},{name:"redirect_policy",description:'<li><p><a name="redirect_policy"></a><a href="#redirect_policy"><code>redirect_policy</code></a> - see <a href="#redirect-policy">Redirect Policy</a></p>\n</li>',elementType:"li",listDepth:1},{name:"resource_access_control_policy",description:'<li><p><a name="resource_access_control_policy"></a><a href="#resource_access_control_policy"><code>resource_access_control_policy</code></a> - see <a href="#resource-access-control-policy">Resource Access Control Policy</a></p>\n</li>',elementType:"li",listDepth:1},{name:"set_request_header_policy",description:'<li><p><a name="set_request_header_policy"></a><a href="#set_request_header_policy"><code>set_request_header_policy</code></a> - see <a href="#set-request-header-policy">Set Request Header Policy</a></p>\n</li>',elementType:"li",listDepth:1},{name:"ssl_negotiation_policy",description:'<li><p><a name="ssl_negotiation_policy"></a><a href="#ssl_negotiation_policy"><code>ssl_negotiation_policy</code></a> - see <a href="#set-negotiation-policy">SSL Negotiation Policy</a></p>\n</li>',elementType:"li",listDepth:1},{name:"trusted_certificate_policy",description:'<li><p><a name="trusted_certificate_policy"></a><a href="#trusted_certificate_policy"><code>trusted_certificate_policy</code></a> - see <a href="#trusted-certificate-policy">Trusted Certificate Policy</a></p>\n</li>',elementType:"li",listDepth:1},{name:"application-cookie-stickiness-policy",description:'<h3 id="application-cookie-stickiness-policy">\n<a class="anchor" href="#application-cookie-stickiness-policy" name="application-cookie-stickiness-policy">\xbb</a>\n  Application Cookie Stickiness Policy\n</h3>',elementType:"h3"},{name:"",description:"<p>Enable session stickiness (session affinity) for any request based on a given cookie name specified in the policy.</p>",elementType:"p"},{name:"example",description:'<h4 id="example">\n<a class="anchor" href="#example" name="example">\xbb</a>\n  Example\n</h4>',elementType:"h4"},{name:"",description:'<div class="highlight"><pre class="highlight hcl"><code><span class="n">resource</span> <span class="s2">"opc_lbaas_policy"</span> <span class="s2">"application_cookie_stickiness_policy"</span> <span class="p">{</span>\n  <span class="n">load_balancer</span> <span class="o">=</span> <span class="s2">"${opc_lbaas_load_balancer.lb1.id}"</span>\n  <span class="nb">name</span>          <span class="o">=</span> <span class="s2">"example_application_cookie_stickiness_policy"</span>\n\n  <span class="n">application_cookie_stickiness_policy</span> <span class="p">{</span>\n    <span class="n">cookie_name</span> <span class="o">=</span> <span class="s2">"MY_APP_COOKIE"</span>\n  <span class="p">}</span>\n<span class="p">}</span>\n</code></pre></div>',elementType:"div"},{name:"attributes",description:'<h4 id="attributes">\n<a class="anchor" href="#attributes" name="attributes">\xbb</a>\n  Attributes\n</h4>',elementType:"h4"},{name:"cookie_name",description:"<strong>(Required)</strong> Name of the application cookie used to control how long the load balancer will continue to route requests to the same origin server.\n",elementType:"li",listDepth:1},{name:"cloudgate-policy",description:'<h3 id="cloudgate-policy">\n<a class="anchor" href="#cloudgate-policy" name="cloudgate-policy">\xbb</a>\n  CloudGate Policy\n</h3>',elementType:"h3"},{name:"",description:"<p>protect resources/applications with the help of CloudGate module available in Load Balancer. These headers will enable CloudGate to lookup for the application and the policy present under the appropriate IDCS Tenant containing information for the protection mechanism to be enforced.</p>",elementType:"p"},{name:"example-1",description:'<h4 id="example-1">\n<a class="anchor" href="#example-1" name="example-1">\xbb</a>\n  Example\n</h4>',elementType:"h4"},{name:"",description:'<div class="highlight"><pre class="highlight hcl"><code><span class="n">resource</span> <span class="s2">"opc_lbaas_policy"</span> <span class="s2">"cloudgate_policy"</span> <span class="p">{</span>\n  <span class="n">load_balancer</span> <span class="o">=</span> <span class="s2">"${opc_lbaas_load_balancer.lb1.id}"</span>\n  <span class="nb">name</span>          <span class="o">=</span> <span class="s2">"example_cloudgate_policy"</span>\n\n  <span class="n">cloudgate_policy</span> <span class="p">{</span>\n    <span class="n">virtual_hostname_for_policy_attribution</span> <span class="o">=</span> <span class="s2">"host1.example.com"</span>\n  <span class="p">}</span>\n<span class="p">}</span>\n</code></pre></div>',elementType:"div"},{name:"attributes-1",description:'<h4 id="attributes-1">\n<a class="anchor" href="#attributes-1" name="attributes-1">\xbb</a>\n  Attributes\n</h4>',elementType:"h4"},{name:"virtual_hostname_for_policy_attribution",description:"<strong>(Required)</strong> Host name needed by CloudGate to enforce OAuth policies.\n",elementType:"li",listDepth:1},{name:"load-balancer-cookie-stickiness-policy",description:'<h3 id="load-balancer-cookie-stickiness-policy">\n<a class="anchor" href="#load-balancer-cookie-stickiness-policy" name="load-balancer-cookie-stickiness-policy">\xbb</a>\n  Load Balancer Cookie Stickiness Policy\n</h3>',elementType:"h3"},{name:"",description:"<p>Enables session stickiness (session affinity) for all requests for a given period of time specified in the policy.</p>",elementType:"p"},{name:"example-2",description:'<h4 id="example-2">\n<a class="anchor" href="#example-2" name="example-2">\xbb</a>\n  Example\n</h4>',elementType:"h4"},{name:"",description:'<div class="highlight"><pre class="highlight hcl"><code><span class="n">resource</span> <span class="s2">"opc_lbaas_policy"</span> <span class="s2">"load_balancer_cookie_stickiness_policy"</span> <span class="p">{</span>\n  <span class="n">load_balancer</span> <span class="o">=</span> <span class="s2">"${opc_lbaas_load_balancer.lb1.id}"</span>\n  <span class="nb">name</span>          <span class="o">=</span> <span class="s2">"example_load_balancer_cookie_stickiness_policy"</span>\n\n  <span class="n">load_balancer_cookie_stickiness_policy</span> <span class="p">{</span>\n    <span class="n">cookie_expiration_period</span> <span class="o">=</span> <span class="mi">60</span>\n  <span class="p">}</span>\n<span class="p">}</span>\n</code></pre></div>',elementType:"div"},{name:"attributes-2",description:'<h4 id="attributes-2">\n<a class="anchor" href="#attributes-2" name="attributes-2">\xbb</a>\n  Attributes\n</h4>',elementType:"h4"},{name:"cookie_expiration_period",description:"<strong>(Required)</strong> The time period, in seconds, after which the cookie should be considered stale. If the value is zero or negative the stickiness session lasts for the duration of the browser session.\n",elementType:"li",listDepth:1},{name:"load-balancing-mechanism-policy",description:'<h3 id="load-balancing-mechanism-policy">\n<a class="anchor" href="#load-balancing-mechanism-policy" name="load-balancing-mechanism-policy">\xbb</a>\n  Load Balancing Mechanism Policy\n</h3>',elementType:"h3"},{name:"",description:"<p>Specify a load balancing mechanism for distributing client requests across multiple origin servers</p>",elementType:"p"},{name:"example-3",description:'<h4 id="example-3">\n<a class="anchor" href="#example-3" name="example-3">\xbb</a>\n  Example\n</h4>',elementType:"h4"},{name:"",description:'<div class="highlight"><pre class="highlight hcl"><code><span class="n">resource</span> <span class="s2">"opc_lbaas_policy"</span> <span class="s2">"load_balancing_mechanism_policy"</span> <span class="p">{</span>\n  <span class="n">load_balancer</span> <span class="o">=</span> <span class="s2">"${opc_lbaas_load_balancer.lb1.id}"</span>\n  <span class="nb">name</span>          <span class="o">=</span> <span class="s2">"example_load_balancing_mechanism_policy"</span>\n\n  <span class="n">load_balancing_mechanism_policy</span> <span class="p">{</span>\n    <span class="n">load_balancing_mechanism</span> <span class="o">=</span> <span class="s2">"round_robin"</span>\n  <span class="p">}</span>\n<span class="p">}</span>\n</code></pre></div>',elementType:"div"},{name:"attributes-3",description:'<h4 id="attributes-3">\n<a class="anchor" href="#attributes-3" name="attributes-3">\xbb</a>\n  Attributes\n</h4>',elementType:"h4"},{name:"load_balancing_mechanism",description:"<strong>(Required)</strong> Supported options are <code>round_robin</code>,\n<code>least_conn</code>, and <code>ip_hash</code>.\n",elementType:"li",listDepth:1},{name:"rate-limiting-request-policy",description:'<h3 id="rate-limiting-request-policy">\n<a class="anchor" href="#rate-limiting-request-policy" name="rate-limiting-request-policy">\xbb</a>\n  Rate Limiting Request Policy\n</h3>',elementType:"h3"},{name:"",description:"<p>Limits the number of requests that can be processed per second by the load balancer.</p>",elementType:"p"},{name:"example-4",description:'<h4 id="example-4">\n<a class="anchor" href="#example-4" name="example-4">\xbb</a>\n  Example\n</h4>',elementType:"h4"},{name:"",description:'<div class="highlight"><pre class="highlight hcl"><code><span class="n">resource</span> <span class="s2">"opc_lbaas_policy"</span> <span class="s2">"rate_limiting_request_policy"</span> <span class="p">{</span>\n  <span class="n">load_balancer</span> <span class="o">=</span> <span class="s2">"${opc_lbaas_load_balancer.lb1.id}"</span>\n  <span class="nb">name</span>          <span class="o">=</span> <span class="s2">"example_rate_limiting_request_policy"</span>\n\n  <span class="n">rate_limiting_request_policy</span> <span class="p">{</span>\n    <span class="n">requests_per_second</span>      <span class="o">=</span> <span class="mi">1</span>\n    <span class="n">burst_size</span>               <span class="o">=</span> <span class="mi">10</span>\n    <span class="n">delay_excessive_requests</span> <span class="o">=</span> <span class="kp">true</span>\n    <span class="n">zone</span>                     <span class="o">=</span> <span class="s2">"examplezone"</span>\n  <span class="p">}</span>\n<span class="p">}</span>\n</code></pre></div>',elementType:"div"},{name:"attributes-4",description:'<h4 id="attributes-4">\n<a class="anchor" href="#attributes-4" name="attributes-4">\xbb</a>\n  Attributes\n</h4>',elementType:"h4"},{name:"burst_size",description:'<li><p><a name="burst_size"></a><a href="#burst_size"><code>burst_size</code></a> - <strong>(Required)</strong> The number of requests that can be delayed until it exceeds the maximum number specified as burst size in which case the request is terminated.</p>\n</li>',elementType:"li",listDepth:1},{name:"delay_excessive_requests",description:'<li><p><a name="delay_excessive_requests"></a><a href="#delay_excessive_requests"><code>delay_excessive_requests</code></a> - <strong>(Required)</strong> delay excessive requests while requests are being limited.</p>\n</li>',elementType:"li",listDepth:1},{name:"requests_per_second",description:'<li><p><a name="requests_per_second"></a><a href="#requests_per_second"><code>requests_per_second</code></a> - <strong>(Required)</strong> Maximum number of requests per second.</p>\n</li>',elementType:"li",listDepth:1},{name:"zone",description:'<li><p><a name="zone"></a><a href="#zone"><code>zone</code></a> - <strong>(Required)</strong> Name of the shared memory zone.</p>\n</li>',elementType:"li",listDepth:1},{name:"http_error_code",description:'<li><p><a name="http_error_code"></a><a href="#http_error_code"><code>http_error_code</code></a> - <strong>(Optional)</strong> Status code to return in response to rejected requests. You can specify any status code between 405 to 599. Default is <code>503</code></p>\n</li>',elementType:"li",listDepth:1},{name:"logging_level",description:'<li><p><a name="logging_level"></a><a href="#logging_level"><code>logging_level</code></a> - <strong>(Optional)</strong> Logging level for cases when the server refuses to process requests due to rate exceeding, or delays request processing. Can be one of <code>info</code>, <code>notice</code>, <code>warn</code>, or <code>error</code>.  Default is <code>warn</code></p>\n</li>',elementType:"li",listDepth:1},{name:"list description",description:'<p><a name="rate_limiting_criteria"></a><a href="#rate_limiting_criteria"><code>rate_limiting_criteria</code></a> - (Optional) Criteria based on which requests will be throttled. Default is <code>server</code></p>',elementType:"p"},{name:"server",description:"limit the requests processed by the virtual server\n",elementType:"li",listDepth:2},{name:"remote_address",description:"limit the processing rate of requests coming from a single IP address.\n",elementType:"li",listDepth:2},{name:"host",description:"limit the processing rate of requests coming from a host.\n",elementType:"li",listDepth:2},{name:"zone_memory_size",description:'<li><p><a name="zone_memory_size"></a><a href="#zone_memory_size"><code>zone_memory_size</code></a> - <strong>(Optional)</strong> Size of the shared memory occupied by the zone. Default is <code>10</code></p>\n</li>',elementType:"li",listDepth:1},{name:"redirect-policy",description:'<h3 id="redirect-policy">\n<a class="anchor" href="#redirect-policy" name="redirect-policy">\xbb</a>\n  Redirect Policy\n</h3>',elementType:"h3"},{name:"",description:"<p>Redirects all requests to this load balancer to a specific URI.</p>",elementType:"p"},{name:"example-5",description:'<h4 id="example-5">\n<a class="anchor" href="#example-5" name="example-5">\xbb</a>\n  Example\n</h4>',elementType:"h4"},{name:"",description:'<div class="highlight"><pre class="highlight hcl"><code><span class="n">resource</span> <span class="s2">"opc_lbaas_policy"</span> <span class="s2">"redirect_policy"</span> <span class="p">{</span>\n  <span class="n">load_balancer</span> <span class="o">=</span> <span class="s2">"${opc_lbaas_load_balancer.lb1.id}"</span>\n  <span class="nb">name</span>          <span class="o">=</span> <span class="s2">"example_redirect_policy"</span>\n\n  <span class="n">redirect_policy</span> <span class="p">{</span>\n    <span class="n">redirect_uri</span> <span class="o">=</span> <span class="s2">"https://redirect.example.com"</span>\n    <span class="n">response_code</span> <span class="o">=</span> <span class="mi">306</span>\n  <span class="p">}</span>\n<span class="p">}</span>\n</code></pre></div>',elementType:"div"},{name:"attributes-5",description:'<h4 id="attributes-5">\n<a class="anchor" href="#attributes-5" name="attributes-5">\xbb</a>\n  Attributes\n</h4>',elementType:"h4"},{name:"redirect_uri",description:'<li><p><a name="redirect_uri"></a><a href="#redirect_uri"><code>redirect_uri</code></a> - <strong>(Required)</strong> redirected requests to the specified URI.</p>\n</li>',elementType:"li",listDepth:1},{name:"response_code",description:'<li><p><a name="response_code"></a><a href="#response_code"><code>response_code</code></a> - <strong>(Required)</strong> The exact 3xx response code to use when redirecting</p>\n</li>',elementType:"li",listDepth:1},{name:"resource-access-control-policy",description:'<h3 id="resource-access-control-policy">\n<a class="anchor" href="#resource-access-control-policy" name="resource-access-control-policy">\xbb</a>\n  Resource Access Control Policy\n</h3>',elementType:"h3"},{name:"",description:"<p>Controls what clients have access to the load balancer, based on the IP address or the CIDR range of the incoming request.</p>",elementType:"p"},{name:"example-6",description:'<h4 id="example-6">\n<a class="anchor" href="#example-6" name="example-6">\xbb</a>\n  Example\n</h4>',elementType:"h4"},{name:"",description:'<div class="highlight"><pre class="highlight hcl"><code><span class="n">resource</span> <span class="s2">"opc_lbaas_policy"</span> <span class="s2">"resource_access_control_policy"</span> <span class="p">{</span>\n  <span class="n">load_balancer</span> <span class="o">=</span> <span class="s2">"${opc_lbaas_load_balancer.lb1.id}"</span>\n  <span class="nb">name</span>          <span class="o">=</span> <span class="s2">"example_resource_access_control_policy"</span>\n\n  <span class="n">resource_access_control_policy</span> <span class="p">{</span>\n    <span class="n">disposition</span> <span class="o">=</span> <span class="s2">"DENY_ALL"</span>\n    <span class="n">permitted_clients</span> <span class="o">=</span> <span class="p">[</span><span class="s2">"10.0.0.0/16"</span><span class="p">]</span>\n  <span class="p">}</span>\n<span class="p">}</span>\n</code></pre></div>',elementType:"div"},{name:"attributes-6",description:'<h4 id="attributes-6">\n<a class="anchor" href="#attributes-6" name="attributes-6">\xbb</a>\n  Attributes\n</h4>',elementType:"h4"},{name:"disposition",description:'<li><p><a name="disposition"></a><a href="#disposition"><code>disposition</code></a> - <strong>(Required)</strong> Default policy. <code>DENY_ALL</code> or <code>PERMIT_ALL</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"denied_clients",description:'<li><p><a name="denied_clients"></a><a href="#denied_clients"><code>denied_clients</code></a> - <strong>(Optional)</strong> List of IP address or CIDR ranges identifying clients from which requests must be accepted by the Load Balancer</p>\n</li>',elementType:"li",listDepth:1},{name:"permitted_clients",description:'<li><p><a name="permitted_clients"></a><a href="#permitted_clients"><code>permitted_clients</code></a> - <strong>(Optional)</strong> IP address or CIDR ranges identifying clients from which requests must be denied by the Load Balancer.</p>\n</li>',elementType:"li",listDepth:1},{name:"set-request-header-policy",description:'<h3 id="set-request-header-policy">\n<a class="anchor" href="#set-request-header-policy" name="set-request-header-policy">\xbb</a>\n  Set Request Header Policy\n</h3>',elementType:"h3"},{name:"",description:"<p>Inserts additional information into the standard HTTP headers of requests forwarded to a server pool.</p>",elementType:"p"},{name:"example-7",description:'<h4 id="example-7">\n<a class="anchor" href="#example-7" name="example-7">\xbb</a>\n  Example\n</h4>',elementType:"h4"},{name:"",description:'<div class="highlight"><pre class="highlight hcl"><code><span class="n">resource</span> <span class="s2">"opc_lbaas_policy"</span> <span class="s2">"set_request_header_policy"</span> <span class="p">{</span>\n  <span class="n">load_balancer</span> <span class="o">=</span> <span class="s2">"${opc_lbaas_load_balancer.lb1.id}"</span>\n  <span class="nb">name</span>          <span class="o">=</span> <span class="s2">"example_set_request_header_policy"</span>\n\n  <span class="n">set_request_header_policy</span> <span class="p">{</span>\n    <span class="n">header_name</span>                     <span class="o">=</span> <span class="s2">"X-Custom-Header"</span>\n    <span class="n">value</span>                           <span class="o">=</span> <span class="s2">"foo-bar  "</span>\n    <span class="n">action_when_header_exists</span>       <span class="o">=</span> <span class="s2">"OVERWRITE"</span>\n    <span class="n">action_when_header_value_is</span>     <span class="o">=</span> <span class="p">[</span><span class="s2">"bar"</span><span class="p">,</span> <span class="s2">"foo"</span><span class="p">]</span>\n  <span class="p">}</span>\n<span class="p">}</span>\n</code></pre></div>',elementType:"div"},{name:"attributes-7",description:'<h4 id="attributes-7">\n<a class="anchor" href="#attributes-7" name="attributes-7">\xbb</a>\n  Attributes\n</h4>',elementType:"h4"},{name:"header_name",description:'<li><p><a name="header_name"></a><a href="#header_name"><code>header_name</code></a> - <strong>(Required)</strong></p>\n</li>',elementType:"li",listDepth:1},{name:"action_when_header_exists",description:'<li><p><a name="action_when_header_exists"></a><a href="#action_when_header_exists"><code>action_when_header_exists</code></a> - <strong>(Required)</strong> action to be taken when a header exists in the request. Options: <code>NOOP</code>, <code>PREPEND</code>, <code>APPEND</code>, <code>OVERWRITE</code>, <code>CLEAR</code></p>\n</li>',elementType:"li",listDepth:1},{name:"action_when_header_value_is",description:'<li><p><a name="action_when_header_value_is"></a><a href="#action_when_header_value_is"><code>action_when_header_value_is</code></a> - <strong>(Optional)</strong> List if header values. Action is taken only when the header exists in the request and the header value matches one of the values provided.</p>\n</li>',elementType:"li",listDepth:1},{name:"action_when_header_value_is_not",description:'<li><p><a name="action_when_header_value_is_not"></a><a href="#action_when_header_value_is_not"><code>action_when_header_value_is_not</code></a> - <strong>(Optional)</strong> List if header values. Action is taken only when the header exists in the request and the header value does not match any of the values provided.</p>\n</li>',elementType:"li",listDepth:1},{name:"ssl-negotiation-policy",description:'<h3 id="ssl-negotiation-policy">\n<a class="anchor" href="#ssl-negotiation-policy" name="ssl-negotiation-policy">\xbb</a>\n  SSL Negotiation Policy\n</h3>',elementType:"h3"},{name:"",description:"<p>Define specific SSL protocols, ciphers, and server order preference for the secure connection</p>",elementType:"p"},{name:"example-8",description:'<h4 id="example-8">\n<a class="anchor" href="#example-8" name="example-8">\xbb</a>\n  Example\n</h4>',elementType:"h4"},{name:"",description:'<div class="highlight"><pre class="highlight hcl"><code><span class="n">resource</span> <span class="s2">"opc_lbaas_policy"</span> <span class="s2">"ssl_negotiation_policy"</span> <span class="p">{</span>\n  <span class="n">load_balancer</span> <span class="o">=</span> <span class="s2">"${opc_lbaas_load_balancer.lb1.id}"</span>\n  <span class="nb">name</span>          <span class="o">=</span> <span class="s2">"example_ssl_negitiation_policy"</span>\n\n  <span class="n">ssl_negotiation_policy</span> <span class="p">{</span>\n    <span class="n">port</span> <span class="o">=</span> <span class="mi">8022</span>\n    <span class="n">server_order_preference</span> <span class="o">=</span> <span class="s2">"ENABLED"</span>\n    <span class="n">ssl_protocol</span> <span class="o">=</span> <span class="p">[</span><span class="s2">"SSLv3"</span><span class="p">,</span> <span class="s2">"TLSv1.2"</span><span class="p">]</span>\n    <span class="n">ssl_ciphers</span> <span class="o">=</span> <span class="p">[</span><span class="s2">"AES256-SHA"</span><span class="p">]</span>\n  <span class="p">}</span>\n<span class="p">}</span>\n</code></pre></div>',elementType:"div"},{name:"attributes-8",description:'<h4 id="attributes-8">\n<a class="anchor" href="#attributes-8" name="attributes-8">\xbb</a>\n  Attributes\n</h4>',elementType:"h4"},{name:"ssl_protocol",description:'<li><p><a name="ssl_protocol"></a><a href="#ssl_protocol"><code>ssl_protocol</code></a> - <strong>(Required)</strong> Security protocols supported for incoming secure client connections to the associated listener. Supported options are <code>SSLv2</code>, <code>SSLv3</code>, <code>TLSv1</code>, <code>TLSv1.1</code>, <code>TLSv1.2</code></p>\n</li>',elementType:"li",listDepth:1},{name:"port",description:'<li><p><a name="port"></a><a href="#port"><code>port</code></a> - <strong>(Optional)</strong> The load balancer port for the the SSL protocols and the SSL ciphers.</p>\n</li>',elementType:"li",listDepth:1},{name:"server_order_preference",description:'<li><p><a name="server_order_preference"></a><a href="#server_order_preference"><code>server_order_preference</code></a> - <strong>(Optional)</strong> enable or disable the server order preference for secure connections to associated Listener. <code>ENABLED</code> or <code>DISABLED</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"ssl_ciphers",description:'<li><p><a name="ssl_ciphers"></a><a href="#ssl_ciphers"><code>ssl_ciphers</code></a> - <strong>(Optional)</strong> List of SSL ciphers supported for incoming secure client connections to the associated Listener.</p>\n</li>',elementType:"li",listDepth:1},{name:"trusted-certificate-policy",description:'<h3 id="trusted-certificate-policy">\n<a class="anchor" href="#trusted-certificate-policy" name="trusted-certificate-policy">\xbb</a>\n  Trusted Certificate Policy\n</h3>',elementType:"h3"},{name:"",description:"<p>Identifies a trusted certificate, which the load balancer uses when making a secure connection to the compute instances in the server pool. If you are configuring a secure connection (HTTPS or SSL) between the load balancer and the origin servers, you must add this policy to the load balancer.</p>",elementType:"p"},{name:"example-9",description:'<h4 id="example-9">\n<a class="anchor" href="#example-9" name="example-9">\xbb</a>\n  Example\n</h4>',elementType:"h4"},{name:"",description:'<div class="highlight"><pre class="highlight hcl"><code><span class="n">resource</span> <span class="s2">"opc_lbaas_policy"</span> <span class="s2">"trusted_certificate_policy"</span> <span class="p">{</span>\n  <span class="n">load_balancer</span> <span class="o">=</span> <span class="s2">"${opc_lbaas_load_balancer.lb1.id}"</span>\n  <span class="nb">name</span>          <span class="o">=</span> <span class="s2">"example_trusted_certificate_policy"</span>\n\n  <span class="n">trusted_certificate_policy</span> <span class="p">{</span>\n    <span class="n">trusted_certificate</span> <span class="o">=</span> <span class="s2">"${opc_lbaas_ssl_certificate.cert1.uri}"</span>\n  <span class="p">}</span>\n<span class="p">}</span>\n</code></pre></div>',elementType:"div"},{name:"attributes-9",description:'<h4 id="attributes-9">\n<a class="anchor" href="#attributes-9" name="attributes-9">\xbb</a>\n  Attributes\n</h4>',elementType:"h4"},{name:"trusted_certificate",description:"<strong>(Required)</strong> URI of the SSL Certificate\n",elementType:"li",listDepth:1},{name:"additional-attributes",description:'<h2 id="additional-attributes">\n<a class="anchor" href="#additional-attributes" name="additional-attributes">\xbb</a>\n  Additional Attributes\n</h2>',elementType:"h2"},{name:"",description:"<p>In addition to the above, the following values are exported:</p>",elementType:"p"},{name:"state",description:'<li><p><a name="state"></a><a href="#state"><code>state</code></a> - State of the Policy.</p>\n</li>',elementType:"li",listDepth:1},{name:"type",description:'<li><p><a name="type"></a><a href="#type"><code>type</code></a> - The Type of the Policy.</p>\n</li>',elementType:"li",listDepth:1},{name:"uri",description:'<li><p><a name="uri"></a><a href="#uri"><code>uri</code></a> - The Uniform Resource Identifier for the Policy.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opc/r/opc_lbaas_policy.html",docType:""},{id:32,type:"  opc_lbaas_server_pool",properties:[{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the Server Pool.</p>\n</li>',elementType:"li",listDepth:1},{name:"load_balancer",description:'<li><p><a name="load_balancer"></a><a href="#load_balancer"><code>load_balancer</code></a> - <strong>(Required)</strong> The parent Load Balancer the Origin Server Pool.</p>\n</li>',elementType:"li",listDepth:1},{name:"servers",description:'<li><p><a name="servers"></a><a href="#servers"><code>servers</code></a> - <strong>(Required)</strong> List of servers in the Server Pool. To define the server in the server pool, provide IP address or DNS name of the compute instances, and port for load balancer to direct traffic to, in the format <code>host:port</code></p>\n</li>',elementType:"li",listDepth:1},{name:"enabled",description:'<li><p><a name="enabled"></a><a href="#enabled"><code>enabled</code></a> - <strong>(Optional)</strong> Boolean flag to enable or disable the Server Pool. Default is <code>true</code> (enabled).</p>\n</li>',elementType:"li",listDepth:1},{name:"health_check",description:'<li><p><a name="health_check"></a><a href="#health_check"><code>health_check</code></a> - <strong>(Optional)</strong> Enables Load Balancer health check, see <a href="#health-check-attributes">Health Check Attributes</a></p>\n</li>',elementType:"li",listDepth:1},{name:"tags",description:'<li><p><a name="tags"></a><a href="#tags"><code>tags</code></a> - <strong>(Optional)</strong> List of tags.</p>\n</li>',elementType:"li",listDepth:1},{name:"vnic_set",description:'<li><p><a name="vnic_set"></a><a href="#vnic_set"><code>vnic_set</code></a> - <strong>(Optional)</strong> Fully qualified three part name of a vNICSet to be associated with the server pool vNIC. Load Balancer uses this vNICSet to set the right ACLs to allow egress traffic from the load balancer.</p>\n</li>',elementType:"li",listDepth:1},{name:"heath-check-attributes",description:'<h3 id="heath-check-attributes">\n<a class="anchor" href="#heath-check-attributes" name="heath-check-attributes">\xbb</a>\n  Heath Check Attributes\n</h3>',elementType:"h3"},{name:"",description:"<p>The load balancer can perform regular health checks of the origin servers and route inbound traffic to the healthy origin servers.</p>",elementType:"p"},{name:"list description",description:'<p><a name="type"></a><a href="#type"><code>type</code></a> - (Optional) Health check mechanism to use to test the origin servers.   Default is <code>http</code></p>',elementType:"p"},{name:"http",description:"sends an HTTP HEAD to the set <code>path</code> and checks response is in one of the <code>accepted_return_codes</code>\n",elementType:"li",listDepth:2},{name:"path",description:"<li><p><a name=\"path\"></a><a href=\"#path\"><code>path</code></a> - <strong>(Optional)</strong> The path to check. Set the '/' the check all paths. Default is '/'</p>\n</li>",elementType:"li",listDepth:1},{name:"accepted_return_codes",description:'<li><p><a name="accepted_return_codes"></a><a href="#accepted_return_codes"><code>accepted_return_codes</code></a> - <strong>(Optional)</strong> List of HTTP response status codes that indicate the origin server is healthy. Accepted return codes can be one or more of the <code>2xx</code>, <code>3xx</code>, <code>4xx</code>, or <code>5xx</code> codes. Default is <code>["2xx","3xx"]</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"enabled",description:'<li><p><a name="enabled-1"></a><a href="#enabled-1"><code>enabled</code></a> - <strong>(Optional)</strong> Boolean flag to enable or disable the Health Checks. Default is <code>true</code> (enabled).</p>\n</li>',elementType:"li",listDepth:1},{name:"interval",description:'<li><p><a name="interval"></a><a href="#interval"><code>interval</code></a> - <strong>(Optional)</strong> The approximate interval, in seconds, that the load balancer will wait before sending the target request to each origin server, in the range 5 to 300 seconds. Default is <code>30</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"timeout",description:'<li><p><a name="timeout"></a><a href="#timeout"><code>timeout</code></a> - <strong>(Optional)</strong> The amount of time, in seconds, that the load balancer will wait without a response before identifying the origin server as unavailable. The timeout value must be less than the <code>interval</code> value and it should range between 2 to 60. Default is <code>20</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"healthy_threshold",description:'<li><p><a name="healthy_threshold"></a><a href="#healthy_threshold"><code>healthy_threshold</code></a> - <strong>(Optional)</strong> The number of consecutive successful health checks required before moving the origin server to the healthy state. The value of healthy threshold ranges from 2 to 10. Default is <code>5</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"unhealthy_threshold",description:'<li><p><a name="unhealthy_threshold"></a><a href="#unhealthy_threshold"><code>unhealthy_threshold</code></a> - <strong>(Optional)</strong> The number of consecutive health check failures required before moving the origin server to the unhealthy state. The value of unhealthy threshold ranges from 2 to 10. Default is <code>7</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"additional-attributes",description:'<h2 id="additional-attributes">\n<a class="anchor" href="#additional-attributes" name="additional-attributes">\xbb</a>\n  Additional Attributes\n</h2>',elementType:"h2"},{name:"",description:"<p>In addition to the above, the following values are exported:</p>",elementType:"p"},{name:"operational_details",description:'<li><p><a name="operational_details"></a><a href="#operational_details"><code>operational_details</code></a> - Description of the operational state.</p>\n</li>',elementType:"li",listDepth:1},{name:"state",description:'<li><p><a name="state"></a><a href="#state"><code>state</code></a> - State of the Origin Server Pool.</p>\n</li>',elementType:"li",listDepth:1},{name:"status",description:'<li><p><a name="status"></a><a href="#status"><code>status</code></a> - Status of the Origin Server Pool.</p>\n</li>',elementType:"li",listDepth:1},{name:"uri",description:'<li><p><a name="uri"></a><a href="#uri"><code>uri</code></a> - The Uniform Resource Identifier for the Server Pool.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/opc/r/opc_lbaas_server_pool.html",docType:""},{id:33,type:"  opc_storage_container",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the Storage Container.</p>\n</li>',elementType:"li",listDepth:1},{name:"read_acls",description:'<li><p><a name="read_acls"></a><a href="#read_acls"><code>read_acls</code></a> - <strong>(Optional)</strong> The list of ACLs that grant read access. See <a href="#setting-container-acls">Setting Container ACLs</a>.</p>\n</li>',elementType:"li",listDepth:1},{name:"write_acls",description:'<li><p><a name="write_acls"></a><a href="#write_acls"><code>write_acls</code></a> - <strong>(Optional)</strong> The list of ACLs that grant write access. See <a href="#setting-container-acls">Setting Container ACLs</a>.</p>\n</li>',elementType:"li",listDepth:1},{name:"primary_key",description:'<li><p><a name="primary_key"></a><a href="#primary_key"><code>primary_key</code></a> - <strong>(Optional)</strong> The primary secret key value for temporary URLs.</p>\n</li>',elementType:"li",listDepth:1},{name:"secondary_key",description:'<li><p><a name="secondary_key"></a><a href="#secondary_key"><code>secondary_key</code></a> - <strong>(Optional)</strong> The secondary secret key value for temporary URLs.</p>\n</li>',elementType:"li",listDepth:1},{name:"allowed_origins",description:'<li><p><a name="allowed_origins"></a><a href="#allowed_origins"><code>allowed_origins</code></a> - <strong>(Optional)</strong> List of origins that are allowed to make cross-origin requests.</p>\n</li>',elementType:"li",listDepth:1},{name:"exposed_headers",description:'<li><p><a name="exposed_headers"></a><a href="#exposed_headers"><code>exposed_headers</code></a> - <strong>(Optional)</strong> List of headers exposed to the user agent (e.g. browser) in the actual request response</p>\n</li>',elementType:"li",listDepth:1},{name:"max_age",description:'<li><p><a name="max_age"></a><a href="#max_age"><code>max_age</code></a> - <strong>(Optional)</strong> Maximum age in seconds for the origin to hold the preflight results.</p>\n</li>',elementType:"li",listDepth:1},{name:"quota_bytes",description:'<li><p><a name="quota_bytes"></a><a href="#quota_bytes"><code>quota_bytes</code></a> - <strong>(Optional)</strong> Maximum size of the container, in bytes</p>\n</li>',elementType:"li",listDepth:1},{name:"quota_count",description:'<li><p><a name="quota_count"></a><a href="#quota_count"><code>quota_count</code></a> - <strong>(Optional)</strong> Maximum object count of the container</p>\n</li>',elementType:"li",listDepth:1},{name:"metadata",description:'<li><p><a name="metadata"></a><a href="#metadata"><code>metadata</code></a> - <strong>(Optional)</strong> Additional object metadata headers. See <a href="#container-metadata">Container Metadata </a> below for more information.</p>\n</li>',elementType:"li",listDepth:1},{name:"setting-container-acls",description:'<h2 id="setting-container-acls">\n<a class="anchor" href="#setting-container-acls" name="setting-container-acls">\xbb</a>\n  Setting Container ACLs\n</h2>',elementType:"h2"},{name:"",description:"<p>The <code>read_acl</code> consists of a list of <strong>roles</strong> or <strong>referrer designations</strong>. The <code>write_acls</code> consists of a list of <strong>roles</strong>.</p>",elementType:"p"},{name:"list description",description:"<p><strong>roles</strong> can be built-in roles or custom roles. Custom roles are defined in the Users tab in the Oracle Cloud My Services console. For a role that was provisioned as part of another service instance, the format is <code>domainName.serviceName.roleName</code>. For a custom role, the format is <code>domainName.roleName</code>.  Default Storage roles include:</p>",elementType:"p"},{name:"${var.domain}.Storage.Storage_ReadOnlyGroup",description:"\n",elementType:"li",listDepth:2},{name:"${var.domain}.Storage.Storage_ReadWriteGroup",description:"\n",elementType:"li",listDepth:2},{name:"${var.domain}.Storage.Storage_Administrator",description:"\n",elementType:"li",listDepth:2},{name:".r:value",description:"<li><p><strong>referrer designation</strong> indicates the host (or hosts) for which read access to the container should be allowed or denied. When the server receives a request for the container, it compares the referrer designations specified in the Read ACL with the value of the Referer header in the request, and determines whether access should be allowed or denied. The syntax of the referrer designation is: <code>.r:value</code></p>\n</li>",elementType:"li",listDepth:1},{name:"",description:"<p><code>value</code> indicates the host for which access to the container should be allowed. It can be a specific host name (example: <code>.r:www.example.com</code>), a domain (example: <code>.r:.example.com</code>), or an asterisk (<code>.r:*</code>) to indicate all hosts. Note that if <code>.r:*</code> is specified, objects in the container will be publicly readable without authentication.</p>",elementType:"p"},{name:"",description:"<p>A minus sign (-) before value (example: <code>.r:-temp.example.com</code>) indicates that the host specified in the value field must be denied access to the container.</p>",elementType:"p"},{name:"",description:"<p>By default, read access to a container does not include permission to list the objects in the container. To allow listing of objects as well, include the <code>.rlistings</code> directive in the ACL.</p>",elementType:"p"},{name:"container-metadata",description:'<h2 id="container-metadata">\n<a class="anchor" href="#container-metadata" name="container-metadata">\xbb</a>\n  Container Metadata\n</h2>',elementType:"h2"},{name:"",description:"<p>The <code>metadata</code> config defines a map of additional meta data header name value pairs. The additional meta data items are set as HTTP Headers on the container in the form <code>X-Container-Meta-{name}: {value}</code>, where <code>{name}</code> is the name of the metadata item  <code>{value}</code> is the header content. For example:</p>",elementType:"p"},{name:"",description:'<div class="highlight"><pre class="highlight hcl"><code><span class="n">metadata</span> <span class="p">{</span>\n  <span class="s2">"Foo-Bar"</span> <span class="o">=</span> <span class="s2">"barfoo"</span>\n  <span class="s2">"Tags"</span> <span class="o">=</span> <span class="s2">"abc 123 xyz"</span>\n<span class="p">}</span>\n</code></pre></div>',elementType:"div"}],docsUrl:"https://www.terraform.io/docs/providers/opc/r/opc_storage_container.html",docType:""},{id:34,type:"  opc_storage_object",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the Storage Object.</p>\n</li>',elementType:"li",listDepth:1},{name:"container",description:'<li><p><a name="container"></a><a href="#container"><code>container</code></a> - <strong>(Required)</strong> The name of Storage Container the store the object in.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p><strong>Note:</strong> One of <code>content</code>, <code>file</code>, or <code>copy_from</code> must be specified</p>",elementType:"p"},{name:"content",description:'<li><p><a name="content"></a><a href="#content"><code>content</code></a> - <strong>(Optional)</strong> Raw content in string-form of the data.</p>\n</li>',elementType:"li",listDepth:1},{name:"file",description:'<li><p><a name="file"></a><a href="#file"><code>file</code></a> - <strong>(Optional)</strong> File path for the content to use for data.</p>\n</li>',elementType:"li",listDepth:1},{name:"copy_from",description:'<li><p><a name="copy_from"></a><a href="#copy_from"><code>copy_from</code></a> - <strong>(Optional)</strong> name of an existing object used to create the new object as a copy. The value is in form <code>container/object</code>. You must UTF-8-encode and then URL-encode the names of the container and object.</p>\n</li>',elementType:"li",listDepth:1},{name:"content_disposition",description:'<li><p><a name="content_disposition"></a><a href="#content_disposition"><code>content_disposition</code></a> - <strong>(Optional)</strong> Set the HTTP <code>Content-Disposition</code> header to specify the override behaviour for the browser, e.g. <code>inline</code> or <code>attachment</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"content_encoding",description:'<li><p><a name="content_encoding"></a><a href="#content_encoding"><code>content_encoding</code></a> - <strong>(Optional)</strong> set the HTTP <code>Content-Encoding</code> for the object.</p>\n</li>',elementType:"li",listDepth:1},{name:"content_type",description:'<li><p><a name="content_type"></a><a href="#content_type"><code>content_type</code></a> - <strong>(Optional)</strong> set the MIME type for the object.</p>\n</li>',elementType:"li",listDepth:1},{name:"delete_at",description:'<li><p><a name="delete_at"></a><a href="#delete_at"><code>delete_at</code></a> - <strong>(Optional)</strong> The date and time in UNIX Epoch time stamp format when the system removes the object.</p>\n</li>',elementType:"li",listDepth:1},{name:"etag",description:'<li><p><a name="etag"></a><a href="#etag"><code>etag</code></a> - <strong>(Optional)</strong> MD5 checksum value of the request body. Strongly Recommended.</p>\n</li>',elementType:"li",listDepth:1},{name:"transfer_encoding",description:'<li><p><a name="transfer_encoding"></a><a href="#transfer_encoding"><code>transfer_encoding</code></a> - <strong>(Optional)</strong> Set to <code>chunked</code> to enable chunked transfer encoding.</p>\n</li>',elementType:"li",listDepth:1},{name:"metadata",description:'<li><p><a name="metadata"></a><a href="#metadata"><code>metadata</code></a> - <strong>(Optional)</strong> Additional object metadata headers. See <a href="#object-metadata">Object Metadata </a> below for more information.</p>\n</li>',elementType:"li",listDepth:1},{name:"attributes",description:'<h2 id="attributes">\n<a class="anchor" href="#attributes" name="attributes">\xbb</a>\n  Attributes\n</h2>',elementType:"h2"},{name:"",description:"<p>In addition to the attributes listed above, the following attributes are exported:</p>",elementType:"p"},{name:"id",description:"The combined container and object name path of the object.\n",elementType:"li",listDepth:1},{name:"accept_ranges",description:"Type of ranges that the object accepts.\n",elementType:"li",listDepth:1},{name:"content_length",description:"Length of the object in bytes.\n",elementType:"li",listDepth:1},{name:"last_modified",description:"Date and Time that the object was created/modified in ISO 8601.\n",elementType:"li",listDepth:1},{name:"object_manifest",description:"The dynamic large-object manifest object.\n",elementType:"li",listDepth:1},{name:"timestamp",description:"Date and Time in UNIX EPOCH when the account, container, or object was initially created at the current version.\n",elementType:"li",listDepth:1},{name:"transaction_id",description:"Transaction ID of the request.\n",elementType:"li",listDepth:1},{name:"object-metadata",description:'<h2 id="object-metadata">\n<a class="anchor" href="#object-metadata" name="object-metadata">\xbb</a>\n  Object Metadata\n</h2>',elementType:"h2"},{name:"",description:"<p>The <code>metadata</code> config defines a map of additional meta data header name value pairs. The additional meta data items are set HTTP Headers on the object in the form <code>X-Object-Meta-{name}: {value}</code>, where <code>{name}</code> is the name of the metadata item  <code>{value}</code> is the header content. For example:</p>",elementType:"p"},{name:"",description:'<div class="highlight"><pre class="highlight hcl"><code><span class="n">metadata</span> <span class="p">{</span>\n  <span class="s2">"Foo-Bar"</span> <span class="o">=</span> <span class="s2">"barfoo"</span><span class="p">,</span>\n  <span class="s2">"Sha256"</span> <span class="o">=</span> <span class="s2">"e91ed4f93637379a7539cb5d8d0b5bca3972755de4f9371ab2e123e7b4c53680"</span>\n<span class="p">}</span>\n</code></pre></div>',elementType:"div"}],docsUrl:"https://www.terraform.io/docs/providers/opc/r/opc_storage_object.html",docType:""}]}}]);